{"url": "https://www.bseindia.com/markets/MarketInfo/DispNewNoticesCirculars.aspx?page=20191030-1", "title": "\r\n\tNotice Number\r\n", "h1": "AR140@@DEMAT AUCTION", "body_text": "AR140 \u00a0 DEMAT AUCTION \u00a0 BSE Limited invites offers from the trading members of the Exchange for purchase of the following securities in Auction in respect of Rolling Settlement No.DR-140/2019-20. \u00a0 The offers will be accepted on BOLT, by the Exchange on Wednesday, October 30, 2019 as detailed below: \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  \r\n Session Timings Auction offer entry 02.00 p.m. to 2.45 p.m. Auction Matching 02.45 p.m. to 03.00 p.m. Delivery Statement and report \r\n            of accepted auction offers 03.00 p.m. to 03.30 p.m. Money Statement & final reports 03.55 p.m. to 05.30 p.m. \u00a0 With reference to Notice No.20190614-19 dated June 06, 2019,   Members and Custodians are requested to note that, Auction funds and securities pay-in timings in will be revised to 08:30 a.m. (instead of 09:30 a.m.) w.e.f. Friday, June 21, 2019, accordingly all depository pay-in instruction for auction pay-in should be completed in stipulated timings. \u00a0 Trading members may note that, after implementation of Uniform Membership structure in Equity Cash Segment, settlement will be done through Clearing Member of a Trading Member. The restriction on trading members on offering securities in auction in the settlement in which they have short delivered such securities is now removed. \u00a0 Trading members should take utmost care while punching ISIN securities code and rate. In case of punching errors, no corrections will be permitted. The Exchange reserves the right to accept or reject any offer without assigning any reason thereof. \u00a0 Trading members may further note that sometimes the transactions in the scrips which are entered into Cum-Right /Cum-Bonus/cum-split basis are auctioned at a subsequent date when the scrip becomes Ex-Right /Ex \u2013Bonus/Ex-Split. Trading members are therefore, requested to refer the cutoff rate (which is the close out rate) appearing in the \u201cAuction offer Entry Screen\u201d and accordingly give their auction offers, which will take care of Cum-Rights/Cum-Bonus/Cum-Split rates. Trading members must also refer notices issued by Corporate Relationship Department from time to time informing about the scrips becoming Ex-Rights/Ex-Bonus/Ex-Split. Any subsequent request from the trading members to cancel the auction offer on account of Ex-Right/Ex-Bonus/Ex-Split rates offered for Cum-Right/Cum-Bonus/Cum-Split transactions will not be entertained. \u00a0 The Pay-in of the Auction will be held on Thursday, October 31, 2019 at 08.30 a.m.  \u00a0 For Indian Clearing Corporation Ltd. \u00a0 \u00a0 Ajay Darji Asst. General Manager \u00a0 Date: Wednesday, October 30, 2019 \u00a0", "size": 41413, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.20300030708312988, "depth": 0, "status": 200, "links_url": "https://www.bseindia.com/markets/MarketInfo/DispNewNoticesCirculars.aspx?page=20191030-1@@https://www.bseindia.com/markets/MarketInfo/DispNewNoticesCirculars.aspx?page=20191030-1@@https://www.bseindia.com/markets/MarketInfo/DownloadAttach.aspx?id=20191030-1&attachedId=00930e37-33c8-4a32-8710-2b94641e4004", "links_text": "@@ @@off140.txt", "links_nofollow": "False@@False@@False", "img_alt": "BSEIndia@@@@Close", "img_src": "../../include/images/topbanner.jpg@@../../include/images/imgprint.gif@@../../include/images/close01.gif", "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:29", "resp_headers_content-length": "41413", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic