{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=39aff3d1-eecc-4d3a-9f79-eb2b3fe4c8a9", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "h2": "Media Release", "body_text": "Media Release Media Release \u00a0 Alphalogic Techsys Limited and Transpact Enterprises Limited  gets listed on BSE Startups Platform/ \u00a0 Maharashtra-based  Alphalogic Techsys Limited and Transpact Enterprises Limited become first to get listed on  BSE Startups Platform \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  \r\n Mumbai, September 5, 2019:   Alphalogic Techsys Limited and Transpact Enterprises Limited  became  the  first  companies to get listed on the BSE Startups Platform on September 5, 2019. On December 22, 2018,  BSE  had become the first stock exchange to get the approval from SEBI and launch its Startups platform.  \u00a0 Alphalogic Techsys Limited  came out with an initial public offering of  7,36,000   Equity Shares of Rs.10/- Each (\u201cEquity Shares\u201d) for cash at a price of  Rs .  84 /- Per Equity Share (The \u201cOffer Price\u201d), aggregating to Rs. 618.24   lakh.   The company has successfully completed its public issue on August 28, 2019.  Transpact Enterprises Limited  came out with an initial public offering of  1,04,000   Equity Shares of Rs.10/- Each (\u201cEquity Shares\u201d) for cash at a price of  Rs . 130 /- Per Equity Share (The \u201cOffer Price\u201d), ggregating to Rs. \u2019135.20\u2019   lakh.   The company has successfully completed its public issue on August 28, 2019. \u00a0 Alphalogic Techsys Limited  is a  Maharashtra-based company whose registered office is at Pune. The company is engaged in the business operations which may broadly be categorized as technology services and technology solutions. They provide their clients with Technology Consulting services, offering end-to-end technology solutions and support. Clients range from start-ups to established companies, engaged in Healthcare, Saas Software, E-commerce, Fintech, Social Networking, and other industries.  Kolkata-based  Finshore Management Services Limited  was  the lead manager for  Alphalogic Techsys Limited \u00a0 Transpact Enterprises Limited  is a Maharashtra-based company whose registered office is at Mumbai. It is a MedTech startup with a focus to provide innovative, cost-effective and comprehensive solutions, products with strategic partnerships and collaborative relationships to help especially abled people to transcend their barriers. Mumbai-based  Aryaman Financial Services Limited   was  the lead manager for  Transpact Enterprises Limited. \u00a0 The above companies listed on BSE Startups Platform have raised Rs. 7.53 crore from the market and total market capitalization of these companies as on September 5, 2019 is 28.33 crore. BSE is the market leader in this segment with a market share of 100 percent. \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. Media Contact: Yatin Padia / Rahul Vyas / Shruti Nitesh 022 2272 8516 / 2272 8472 / 8108000974 Yatin.padia@bseindia.com / Rahul.vyas@indiainx.com  /shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u00a0", "size": 52625, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.24064326286315918, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "5262