{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=b566e473-60f9-4514-b73e-42bd81af5a62", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release \u00a0 BSE resolved 149 investor\u2019s complaints against companies during the month of September 2019 \u00a0 Mumbai: October 03, 2019 : During the month of September, BSE received 194 complaints against 159 companies. In the same period 149 complaints were resolved against 125 listed companies. These resolved complaints include complaints brought forward from the previous periods. \u00a0 \r\n Type of complaints Complaints received Complaints resolved \u00a0 Against Active Companies Against Suspended Companies Total Against Active Companies Against Suspended Companies Total I 0 0 0 2 0 2 II 32 6 38 26 5 31 III 1 2 3 0 0 0 IV 108 1 109 74 1 75 V 0 0 0 0 0 0 VI 36 8 44 37 4 41 Total 177 17 194 139 10 149 \u00a0 The complaints received by BSE from Investors have been categorized as under: \u00a0 \r\n Type I Non-receipt of money (Refund, Interest, Redemption, Fractional Entitlement.) Type II :\u00a0 Non-receipt of Equity shares ( Demat & Physical : In Public/Rights issue, Remat, Transfer, Transmission, Conversion / Endorsement / Consolidation/ Splitting / Duplicate Certificate) Type III Non-receipt of Debt Securities ( Demat & Physical : In Public/Rights issue, Remat, Transfer, Transmission, Conversion / Endorsement / Consolidation/ Splitting / Duplicate Certificate) Type IV Non-receipt of Corporate benefits / entitlements ( Dividend, Bonus, Rights form, \u00a0Buyback letter of offer, Delisting letter of offer, Annual Report ) Type V Non-receipt of Interest for delay in : ( Refunds, Dividend, Interest on debt security, Redemption of debt security , Securities ) Type VI Others ( Including Non-Adherence to Corporate Governance Norms ) \u00a0 \u00a0 \u00a0 Companies with highest number of complaints pending as on 30 th  September, 2019 \u00a0 \r\n Sr. No. Company Name Category Number of complaints pending as on 30/09/2019 1 Geodesic Ltd. XT 27 2 J.K. Pharmachem Ltd. X 16 3 Teem Laboratories Ltd. X 12 4 Gujarat Perstorp Electronics Ltd. P 12 5 Gujarat Narmada Flyash Co. Ltd. XT 11 6 Blazon Marbles Limited X 11 7 Global Securities Limited XT 10 8 Gujarat Meditech Ltd. Z  10 9 Softrak Venture Investments Ltd.  X 9 10 Rane Computers Consultancy Ltd P 8 \u00a0 These aforesaid companies are presently suspended at the Exchange for surveillance reasons/ certain non-compliances with the listing regulations/procedural reasons or as per operation of law. \u00a0 \u00a0 Media Contact Yatin Padia 022 2272 8516 yatin.padia@bseindia.com \u00a0 \u00a0 \u00a0 \u00a0", "size": 196735, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.3380410671234131, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "196735", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.goo