{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=6fe54ebd-6b37-4a86-af1d-100ef539d8ca", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release  BSE - Ebix Receives In-principle Approval from IRDAI to Start Insurance Distribution Mumbai \u2013 October 29, 2019 \u2013  BSE, Asia\u2019s oldest exchange and its joint venture (JV) partner Ebix, the global leader in insurance exchanges (NASDAQ: EBIX), has received in-principle approval for Certificate of Registration to act as a direct insurance broker under the IRDAI (Insurers Brokers) Regulations, 2018. The venture, branded as BSE-Ebix\u00a0Insurance Broking Pvt. Ltd., will enable distribution outlets, wealth management advisors, Point of Sales (POSs) to sell life and non-life insurance products. The actual insurance distribution of BSE-Ebix will commence after receipt of certificate of license from IRDAI. Speaking on the in-principle approval, Mr. Ashishkumar Chauhan, MD & CEO, BSE said, \u201cBSE wants to leverage its world-class technology and expertise in transaction processing and risk management in insurance distribution. We have realized that there is huge demand for investment products, and our platforms like BSE StAR MF are performing very well. We expect to taste similar success in the insurance distribution segment and help insurers expand their network through the combined reach of BSE & EbixCash.\u201d EbixCash is the Indian subsidiary of Ebix, Inc. that today transacts $18 Billion in Gross merchandise value (GMV) on its platforms, besides being an end-to-end services market leader in the financial exchange industry. Ebix Group Chairman, President and CEO Robin Raina said, \u201cThe combined reach of the BSE and EbixCash network in India is unparalleled. The opportunity ahead of the joint venture is gigantic, considering the need to take insurance distribution to every nook and corner of India, in a manner that benefits all entities involved. Through this venture, our goal is to revolutionize not only buying of insurance from a consumer perspective but also enable insurers to distribute insurance products in a highly efficient manner, while automating and integrating complex back-end processes seamlessly with front end distribution.\u201d  BSE-Ebix aims to offer numerous choices to customers, besides reaching to remote villages across India to access these products. The venture will make use of the reach of both BSE and EbixCash that spans over 3 lakh outlets across the country and shall cover the entire insurance lifecycle from customer relationship management, agency management, multi-quoting, underwriting, policy creation, claims filing to insurance company and coordinate with insurance company for settlement of claim and back-end insurance policy administration. \u00a0 \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, commodity derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1,  2018, BSE launched commodity derivatives trading in Gold, Silver, Copper ,  Oman Crude Oil Guar Gum , Guar Seeds & Turmeric . BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.\u00a0  BSE has set up an Investor Protection Fund (IPF) on July 10, 1986 to meet the claims of investors against defaulter Members, in accordance with the Guidelines issued by the Ministry of Finance, Government of India. BSE Investor Protection Fund is responsible for creating Capital markets related awareness among the investor community in India. \u00a0 About Ebix With 50+ offices across 6 continents, Ebix, Inc., (NASDAQ: EBIX) endeavors to provide On-Demand software and E-commerce services to the insurance, financial, healthcare and e-learning industries. In the Insurance sector, Ebix\u2019s main focus is to develop and deploy a wide variety of insurance and reinsurance exchanges on an on-demand basis, while also, providing Software-as-a-Service (\"SaaS\") enterprise solutions in the area of CRM, front-end & back-end systems, outsourced administration and risk compliance services, around the world. With a \"Phygital\u201d strategy that combines 320,000 physical distribution outlets in many Southeast Asian Nations (\u201cASEAN\u201d) countries, to an Omni-channel online digital platform, the EbixCash Financial exchange portfolio encompasses leadership in areas of domestic & international money remittance, foreign exchange (Forex), travel, pre-paid & gift cards, utility payments, lending, wealth management etc. in India and other markets. EbixCash\u2019s Forex operations have emerged as a leader in India\u2019s airport Foreign Exchange business with operations in 32 international airports including Delhi, Mumbai, Bangalore, Hyderabad, Chennai and Kolkata, conducting over $4.8 billion in gross transaction value per year. EbixCash\u2019s inward remittance business in India conducts approx. $6.5 billion gross annual remittance business, confirming its undisputed leadership position in India. EbixCash, through its travel portfolio of Via and Mercury, is also one of Southeast Asia\u2019s leading travel exchanges with over 2,200+ employees, 212,450+ agent network, 25 branches and over 9,800 corporate clients; processing an estimated $2.5 billion in gross merchandise value per year. For more information, visit the Company\u2019s website at  www.ebix.com Contact: Darren Joseph IR@ebix.com or +1 678 281 2027 David Collins or Chris Eddy Catalyst Global + 1 212-924-9800 or  ebix@catalyst-ir.com \u00a0 Yatin Padia / Rahul Vyas 022 2272 8516 / 022 2272 8472 Yatin.padia@bseindia.com  /  Rahul.vyas@indiainx.com \u00a0 \u00a0", "size": 121478, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.4670741558074951, "depth": 0, "status": 200, "links_url": "http://www.ebix.com/", "links_text": "www.ebix.com", "links_nofollow": "False", "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"