{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=a939edf4-f87a-4165-bcad-5e1845507700", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release BSE joins hands with FICCI to foster the MSME sector Mumbai, October 7, 2019: \u00a0  In its endeavor to enhance the MSME and startup environment, BSE in association with FICCI organized a brainstorming session to identify the gaps in the existing policies and make suggestions for robust policies, besides promoting Udyam Saathi and Udyam Sakhi initiatives to foster the MSME sector. The MSMEs were invited to present their summary of ideas and suggestions as well as discuss their main issues of concern to the Ministry. Some of the concerns that were identified were simplifying the MSME definitions, availability of funds which will result in improved attitude of lenders and borrowers, pull up payment delays and increasing market access for the MSMEs. Shri. Ram Mohan Mishra, Additional Secretary and Development, Ministry of MSME, Government of India ,  Shri. Nirankar Saxena, Deputy Secretary General of FICCI and Shri Ashishkumar Chauhan, MD & CEO, BSE grace the occasion .  \u00a0 Around 40 stakeholders- including  20 MSMEs  participated at the event.  Shri Ashishkumar Chauhan, MD & CEO, BSE grace the occasion while addressing the delegation he emphasized the need of having vibrant ecosystem comprising of debt and equity is required to address the concerns of MSME\u2019s. Shri. Ajay Kumar Thakur, Head SMEs and Startups, BSE briefed the delegates that BSE is a very important stakeholder in MSME and Star Up Eco system. BSE has been the pioneer in creating the SME and Star up platform which has helped 310 SME\u2019s in raising Rs 3300 crs. BSE will take all initiatives for the growth of SME\u2019s and Start up eco system.  Some of the other suggestions that were presented at the session were: \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Create a database of businesses who have a chronic habit of issuing cheques that bounce \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Increase digitisation of corporate reporting: Expand scope of XBRL reporting \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Don\u2019t give GST reporting waivers \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Digital exchange of documents in the transport industry \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Fix the rating agencies incentives linked to job creation About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Shruti Nitesh 022 2272 8516 / 2272 8472 / 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/shruti.nitesh@adfactorspr.com \u00a0", "size": 37179, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.6892433166503906, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "25033", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.goog