{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=47482ae2-f4ef-4479-804a-f037a1608c43", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release BSE inks pact with Steel Users Federation of India \u00a0 Mumbai, 29th August 2019:   BSE, Asia\u2019s oldest exchange and now the world\u2019s fastest exchange with the speed of 6 microseconds  has signed a Memorandum of Understanding (MoU) with the Steel Users Federation of India (SUFI). This strategic collaboration between the two giants would help in stronger and transparent steel trade. \u00a0 BSE and SUFI will work towards enlisting steel futures in both long and flat segments. This will bring in stability, avert risks and facilitate a level-playing field to one and all players. \u00a0 On this occasion,\u00a0 Ashishkumar Chauhan, MD & CEO, BSE , commented, \u201cI look forward to a lasting and fruitful relationship between Steel Users Federation of India and BSE. The tie-up is a key step for moving forward, opening new avenues and opportunities for the growth of steel markets in India. SUFI has achieved a remarkable success in a short span of time. It has been able to bring various stakeholders of the steel industry on a common platform and is marching towards achieving its objective - higher per capita consumption of steel and promoting growth and excellence in the industry.\u201d  \u00a0 Calling the MoU an iconic moment for the steel industry in India,  Nikunj Turakhia, President of the Steel Users Federation of India (SUFI ), said, \u201cThis move brings equal chances for everyone to invest in steel futures. This much-needed public participation will enable the sector to offer increased employment opportunities as well.\u201d \u00a0 Underlining equal opportunities to everyone in the steel trade, Mr. Turakhia and Mr. Chauhan exchanged the MoU documents at the International Convention Hall, PJ Towers, Dalal Street. The event witnessed the presence of members from various trade bodies such as Steel Chamber of India, DISMA, CAMIT, CORSIA and steel mills such as Essar Steel, Tata Steel and Arcelor Mittal. \u00a0 \u00a0 About BSE \u00a0 BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.\u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg).\u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.\u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed.