 st  August 2019. \u00a0 \r\n Sr. No. Company Name Category Number of complaints pending as on 31/08/2019 1 Geodesic Ltd. XT 27 2 J.K. Pharmachem Ltd. X 16 3 Gujarat Perstorp Electronics Ltd. P 12 4 Teem Laboratories Ltd. X 12 4 Gujarat Narmada Flyash Co. Ltd. XT 11 5 Blazon Marbles Limited X 11 6 Global Securities Limited XT 10 7 Gujarat Meditech Ltd. Z 10 8 Softrak Venture Investments Ltd.  X 9 9 Willard India Ltd.  XT 8 10 Maharashtra Krishna Valley Dvpt. Ltd. \u00a0 8 These aforesaid companies are presently suspended at the Exchange for surveillance reasons/ certain non-compliances with the listing regulations/procedural reasons or as per operation of law. \u00a0 \u00a0 Media Contact Yatin Padia 022 2272 8516 yatin.padia@bseindia.com \u00a0 \u00a0 \u00a0 \u00a0", "size": 199536, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.6334502696990967, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blo