{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=6c3cdbbd-6927-48df-8c8c-728bfcdc55ee", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release Muhurat Trading Session at BSE in the Vikram Samvat Year 2076 \u00a0 Mumbai: 27 October 2019 , BSE welcomed the Vikram Samvat Year 2076 with much fanfare and panache. The Lakshmi Pooja and the Muhurat Trading Session on Sunday, 27 October 2019 from 6:15 p.m. to 7:15 p.m. was graced by a lot of recognized personalities from broking fraternity, corporates and Bollywood too, Miss Mouni Roy is an Indian film and television actress. She is best known for playing Krishna Tulsi in Kyunki Saas Bhi Kabhi Bahu Thi in 2007, Sati in Devon Ke Dev...Mahadev and Shivanya/Shivangi in Naagin. She has also played the role of Meera in Junoon \u2013 Aisi Nafrat Toh Kaisa Ishq. She was a finalist on Jhalak Dikhhla Jaa in 2014. She is a trained Kathak dancer. In 2018, she made her film debut opposite Akshay Kumar with the sports biopic Gold. In her latest film, Roy stars alongside John Abraham in Robbie Grewal's espionage thriller Romeo Akbar Walter. She was last seen portraying Maha Naagrani Shivangi and Shivanya in the final episodes of Naagin season 3. & Mr Rajkummar Rao, also known as Rajkumar Yadav, is an Indian actor. He has established a career in Hindi cinema and is the recipient of several awards, including a National Film Award, three Filmfare Awards, and an Asia Pacific Screen Award. Rao graduated from the University of Delhi and went on to study acting at the Film and Television Institute of India and graduated from there in 2008. He then moved to Mumbai and made his film debut with the experimental anthology film Love Sex Aur Dhokha. \u00a0 On the backdrop of festive mood, BSE commenced its evening by felicitating top volume brokers in Equity, Equity Retail, equity institutional segment, Equity Prop Segment, Equity, Commodities,  \u00a0 Algo Segment, Currency Derivatives,\u00a0Sovereign\u00a0Gold Bond, Interest Rate Derivatives, Fixed Income, Settlement of Corporate Bonds segments and IPO / FPO /OFS, Mutual Fund and SME Members. \u00a0 \r\n \r\n     \r\n         \r\n             \r\n             Top 5 Performers in Primary Market Segment (Equity - IPO/ FPO Bids \u2013 Members) Fy 2018-19 \r\n             \r\n         \r\n         \r\n             \r\n             1 \r\n             \r\n             \r\n             Axis Capital Limited \r\n             \r\n         \r\n         \r\n             \r\n             2 \r\n             \r\n             \r\n             Edelweiss Broking Limited \r\n             \r\n         \r\n         \r\n             \r\n             3 \r\n             \r\n             \r\n             J M Financial Services Limited \r\n             \r\n         \r\n         \r\n             \r\n             4 \r\n             \r\n             \r\n             Kotak Securities Limited \r\n             \r\n         \r\n         \r\n             \r\n             5 \r\n             \r\n             \r\n             IIFL Wealth Management Limited \r\n             \r\n         \r\n         \r\n             \r\n             Top 5 Performers in Primary Market Segment (Equity - IPO/ FPO Bids \u2013 ASBA Banks) Fy 2018-19  \r\n             \r\n         \r\n         \r\n             \r\n             1 \r\n             \r\n             \r\n             Citibank N.A. \r\n             \r\n         \r\n         \r\n             \r\n             2 \r\n             \r\n             \r\n             State Bank of India \r\n             \r\n         \r\n         \r\n             \r\n             3 \r\n             \r\n             \r\n             HDFC Bank  \r\n             \r\n         \r\n         \r\n             \r\n             4 \r\n             \r\n             \r\n             ICICI Bank  \r\n             \r\n         \r\n      