ng' marks the beginning of the new trading year for the Gujarati community, who form the bulk of share brokers in India. For the trading communities the new financial year begins with the next day after Diwali. That is the reason pooja is performed for account books, safes and tijoris on Dhanteras as well as on Diwali day. A coin is placed on the account books before the pooja which is supposed to signify wealth, and the coin is preserved and again used in the pooja in the next Diwali. The stock brokers perform \"Chopra Pooja (Worshipping of Account Books)\u201d at the exchange and a customary 'Muhurat Trading' trading takes place at the stock exchange. The story goes that on the night of Lakshmi Pooja, the Goddess comes to reside at the place of the Pooja that is the reason the traders and shopkeepers keep awake with lights burning all night to welcome Lakshmi any time she chooses to come. \u00a0 Media Contact Yatin Padia \u2013 022 2272 8516 / Rahul Vyas \u2013 022 2272 8472 \r\nCorporate Communications \r\n yatin.padia@bseindia/ \u00a0Rahul.vyas@indiainx.com \u00a0 \u00a0 \u00a0 \u00a0", "size": 742026, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.43088769912719727, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "742026", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://ww