{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=b795ab58-6292-41ff-9408-7b5405a4764c", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release BSE to introduce Liquidity Enhancement Scheme in equity derivatives from August 26, 2019 Mumbai, August 13, 2019:\u00a0 India's leading stock exchange BSE (Bombay Stock Exchange) plans to launch the Liquidity Enhancement scheme (LES) in Equity Derivative segment from 26th Aug 2019 to incentivize investors and market participants to trade on BSE Derivatives. The LES will be provided on Index Futures and Options and fifty Stock Futures and Options. The LES is expected to encourage market participants to provide two way quotes and to trade on BSE Derivatives segment. BSE has waived off transaction charges applicable in Equity Derivatives Segment. Recently Interoperability was introduced in Equity and Equity Derivatives segment, which now allows Investors and market participants to trade on multiple exchanges with margin deposited at a single clearing corporation. The investors are now able to square off their positions across Exchanges. Investors will also benefit from a common settlement price across Exchanges. About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. \r\nBSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.  Media Contact: \r\nYatin Padia / Rahul Vyas  \r\n022 2272 8516 / 2272 8472  \r\n Yatin.padia@bseindia.com  /  Rahul.vyas@indiainx.com \u00a0 \u00a0 \u00a0", "size": 16876, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.16240477561950684, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "16876", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,q