{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=675ab679-db87-4a9c-ba75-b985804d5d79", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release BSE StAR MF processes over 43.55 lakh transactions in July Surpasses 1.21 crore transactions in the 1 st \u00a0quarter, April to June 2019 \u00a0 Mumbai, August 01, 2019 : Continuing its stellar performance, BSE StAR MF, India's largest Mutual Funds Distributor platform, has processed 43.55 lakh transactions in July 2019. The previous best was 42.50 lakh transactions in April 2019.  The platform has also registered 2.38 lakh new SIPs amounting to Rs 65 crore in the month of July. Overall, the platform has surpassed 1.21 crore transactions in the first quarter, April to June 2019. BSE\u2019s newly-launched BSE StAR MF app (StAR MF Mobility) has processed over 26,000 transactions since its launch, amounting to Rs 470 crore. The app was launched to help the distributor and the IFAs (Independent Financial Advisors) to register clients on real-time basis and execute paperless transactions. It is the superior support system and distribution reach of BSE StAR MF that are enabling the platform to grow exponentially with over 26,000 registered distributors in India. About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 Yatin.padia@bseindia.com / Rahul.vyas@indiainx.com  / mihir.dani@adfactorspr.com /shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u00a0 \u00a0 \u00a0", "size": 28808, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.1992933750152588, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "28808", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", 