{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=c3d0d005-5398-414e-a7f9-8e8c0ea7e6c5", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release Over 54,000 IFAs/members now on BSE StAR MF Platform Mumbai, August 30th, 2019:  BSE StAR MF, India's largest Mutual Funds Distributor platform has been consistently outperforming with number of orders, new registrations and SIPs. \u00a0 The table below shows how BSE StAR MF segment has performed from May to July, 2019: \u00a0 \r\n Month Transactions count Transactions Amount (In Cr) SIP/XSIPs count \u00a0 SIPs/XSIPs Amount (In Cr) May 39,97,008 17,692 1,52,750 \u00a0 \u00a0 46.8 June 39,19,212 10,390 1,76,710 \u00a0 49.53 July 43,55,381 10,710 2,81,962 \u00a0 65 \u00a0 \u00a0 As of over 54,000 IFAs/members can use our platform to efficiently and effectively\u00a0address their customers\u2019 requirements. The exchange had launched BSE StAR MF app in May in order to enable Mutual Fund Distributors process transactions on the go! In a span of three months, the app has processed 42,040 transactions. With no paperwork and the ease of doing business on a smartphone, BSE Mutual Fund platform has become a one-stop shop for settlement. \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.  \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Shruti Nitesh 022 2272 8516 / 2272 8472 / 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/ shruti.nitesh@adfactorspr.com \u00a0 \u00a0", "size": 76788, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.3034327030181885, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "50298", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q