{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=29dfb04b-322a-4fc7-823e-80cf85f2d05d", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release \u00a0 Operating EBITDA (consolidated) for the quarter ended 30 th  June, 2019 increased by 120 % to Rs 5.5 crore from Rs 2.5 crore in previous quarter. \u00a0 Percentage of Operating revenue (consolidated) to total revenue (consolidated) for the quarter ended 30 th  June, 2019 increased to 68% from 64% in previous quarter. \u00a0 BSE proposes to buyback 67.65 lakhs fully paid up equity shares of Rs 2 each at Rs 680 per equity share through tender offer route amounting to Rs 460 crore. \u00a0 BSE has paid final dividend of Rs 25 per equity share of face value Rs 2 each on July 17, 2019. \u00a0 \u00a0 Business update across the segments \u2013 \u00a0 \u00fc \u00a0  Mutual Fund Segment  - Orders processed in Mutual Fund Segment increased by 75% to 1.2 crore in Q1 FY20 from 0.7 crore in Q1 FY19. \u00fc \u00a0  India International Exchange (IFSC) Ltd. (\u201cIndia INX\u201d)  - Average daily turnover in India INX, BSE\u2019s wholly owned subsidiary at GIFT City, Gandhinagar increased by 321% to USD 1,879 million in Q1 FY20 from USD 447 million in Q1 FY19.   India INX has also recorded highest number of contracts traded of 405,544 with a turnover of USD 4.9 billion (  Rs  34,031 crore approx.) on July 25, 2019. \u00fc \u00a0  Commodity Derivatives Segment  - Successfully launched Commodity Derivative in Turmeric during the quarter ended June 30, 2019.  \u00a0 MUMBAI, August 2, 2019:  BSE Ltd. (BSE), Asia\u2019s oldest and first universal exchange and World\u2019s fastest exchange with a speed of 6 microseconds, announced its unaudited consolidated and standalone financial results for the quarter ended June 30, 2019.  \u00a0 Quarterly Consolidated Financial Results at a Glance Particulars Q1 FY20  (Rs crore) Q4 FY19  (Rs crore) QoQ Growth Revenue from Operations 112.1 115.7 \u21933% Less : Operating Expenses 106.6 113.2 \u21936% Operating EBIDTA 5.5 2.5 \u00a0\u00a0\u00a0  \u2191 120% Operating EBIDTA Margin 5% 2% \u00a0 Add : Non-operational revenue  53.9 55.9 \u21934% Less : Non-operating expenses 12.5 14.9 \u00a0  \u219316% Profit before Non-recurring/Exceptional items 46.9 43.5 \u2191 8 % Add: Non-recurring revenue - 10.5 \u00a0\u00a0\u00a0  \u2193100% Less: Non-recurring/exceptional expenses 3.8 6.4 \u00a0  \u219341% Add : Share of Profit of Associates 7.0 8.7 \u00a0  \u219320 % Less : Taxes 8.8 4.4 \u00a0\u00a0\u00a0  \u2191100 % Net Profit  41.3 51.9 \u00a0  \u219320 % Net Profit Margin 25% 29% \u00a0 Total Revenue 166.0 182.1 \u00a0 \u21939 % Business Highlights for the quarter Ended June 30, 2019 \u00a0 \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  StAR \u00a0  MF Platform  :   BSE has been able to effectively monetize its StAR MF platform and the revenue earned from the services provided under BSE\u2019s StAR MF platform for the quarter ended June 30, 2019 is 11% of its revenue from operations which is almost 80% as much as what is earned by the BSE in its equity segment.  BSE continues to upgrade and bring technological innovations to its StAR MF platform. BSE\u2019s newly launched BSE StAR MF mobile app has processed over 10,000 transactions in a month (May 15, 2019 to June 15, 2019) amounting to Rs 101 crore. The number of registered mutual fund distributors in the Mutual Fund segment increased by 146% to 26,269 as on July 31, 2019 as compared to 10,678 as on June 30, 2018. The total number of XSIPs registered under this segment increased by 27% to 4.67 lakhs for the quarter ended \u00a0  June 30, 2019 from 3.68 lakhs for the quarter ended June 30, 2018 .  The total number of orders processed in the Mutual Fund Segment increased by 75% to 1.22 crores for the quarter ended June 30, 2019 from 0.70 crores for the quarter ended June 30, 2018 .  The total value of orders processed in the Mutual Fund Segment increased by 39% to Rs 54,449 crore for the quarter ended June 30, 2019 from Rs 39,125 crore for the quarter ended June 30, 2018. \u00a0  Further, the total number of orders received in the month of June 2019 is higher by 57% as compared to the orders received in the month of June 2018 . \u00a0 BSE StAR MF, India\u2019s largest Mutual Funds Distributor platform recorded a new high of 7.6 lakh transactions on June 10, 2019. BSE StAR MF surpassed the earlier highest of 7.2 lakh transactions in a single day on March 11, 2019 . \u00a0 The group has redefined the service standards of Mutual Funds Distributors in India. The robustness and seamlessness of BSE StAR MF, the swiftness of distributors, and query resolution through real-time interaction through BSE StAR MF user\u2019s telegram group have created an ideal ecosystem for all stakeholders in India\u2019s Mutual Funds Industry. BSE StAR MF creating an overall distribution network of over 2,00,000 in over 3000 cities and towns of India. BSE has once again exhibited that with scalability, the service standards notch higher. In the current quarter, BSE StAR MF has processed nearly 122 Lakhs transactions amounting to Rs 54,449 crore, processing over 39 lakh transactions per month. \u00a0  BSE\u2019s market share in this segment for FY19 stands at 75%. \u00a0 \u00a0 \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Commodity Derivatives Segment :  In Commodity Derivative segment, ever since the launch of Gold and Silver futures on 1st October 2018, BSE has been expanding its bouquet of commodities. \u00a0  BSE has launched contracts in Oman Crude Oil futures on 26th October, 2018, Copper contracts on 2nd November, 2018, Guar seed and Guar gum on 6th February, 2019, Cotton Futures on 18th February, 2019 and Turmeric on 28th June, 2019 . BSE has tied up with various associations in the commodities business for growth of and development of commodities derivatives business in India. \u00a0  The entities with whom BSE has tied up includes renowned entities including London Metal Exchange, Dubai Mercantile Exchange, Bombay Metal Exchange, Cotton Association of India, Agriculture Price Commission, \u00a0 Federation of Indian Spices Stakeholders, Gems & Jewellery Skill Council of India, Bullion Federation etc. The total number of members admitted in this segment is 264. The average daily turnover in Commodity Derivatives segment for the quarter ending 30th June 2019 was Rs. 238 crore. Currently, as per BSE\u2019s Circular dated 27th September, 2018, BSE has waived transaction charges in this segment till 30th September, 2019. The turnover in this segment has been steadily improving to Rs 47,823 crore till 30th June, 2019 .  Share of Gold derivatives is 34%, Agri derivatives is 60% and Silver derivatives is 6%. \u00a0 \u00a0 \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  India International Exchange (IFSC) Ltd. (\u201cIndia INX\u201d)  :  Average daily turnover in India INX, BSE\u2019s wholly owned subsidiary at GIFT City, Gandhinagar witnessed  a phenomenal growth of 321%  to USD 1,879 million in Q1 FY20 from USD 447 million in Q1 FY19. \u00a0  The turnover comprises of significant contribution by Equity Derivatives Segment as well as Commodity Derivatives Segment. \u00a0  The Equity Derivatives Segment contributed to 91% of average daily turnover and the Commodities Derivatives Segment contributed to 9% of average daily turnover in Q1 FY20.  \u00a0 Average daily turnover for the month of June 2019 was USD 2,779 million.  India INX witnessed an all-time high turnover of over USD 4.9 billion (  Rs  34,031 crore approx.) on its derivative segment on July 25, 2019.  INX\u2019s market share in this segment in Q1 FY20 is 84%. \u00a0 On April 3, 2019 India INX has signed a memorandum of understanding (MoU) with Moscow Exchange (MOEX) with an aim of connecting the investors\u2019 community and companies in both countries and allowing a capital formation platform on a larger scale. BSE and India INX are the first Indian Exchanges to enter into the MoU with Moscow exchange. \u00a0 \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  India INX Global Access (IFSC) Ltd. :  India INX has launched India INX Global Access IFSC Limited (\u201cGlobal Access\u201d), it aims to become the leading financial services provider in IFSC GIFT City in the years ahead by facilitating a centralized access to international financial markets for its customers. For participants at GIFT IFSC, Global Access will provide a unified single-window interface for trading on CME Group of exchanges with immediate effect. For members and clients of India INX, Global Access offers a competitive and sustainable value proposition to access global markets in a cost efficient way. \u00a0 India INX has expanded its vision of being the preferred outbound gateway by providing connectivity to LME and other global exchanges viz. ICE Futures U.S., ICE Futures Europe, EUREX & Euronext N.V. Clients have commenced trading in LME via Global Access in addition to CME Group of exchanges namely CME, CBOT, COMEX, NYMEX. The first trade on LME in India INX Global Access. \u00a0 \u00a0 \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Power Exchange:  BSE along with PTC India Limited and ICICI Bank Limited have filed a petition with the power market regulator, Central Electricity Regulatory Commission on September 7, 2018 for grant of license for setting up a new power exchange. This proposed institutional exchange, subject to necessary regulatory approvals, would leverage on the experience and expertise of its stakeholders in their fields; knowledge of the power sector, funding of power projects and associated infrastructure, setting-up and running various exchanges and platforms in India, and offer the market participants a credible power trading platform. BSE has a stake of 41.08% as on 30th June, 2019 in the proposed power exchange through its wholly owned subsidiary, BSE Investments Limited. \u00a0 \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Insurance Broking:  BSE has set up a Joint venture with Ebix named BSE Ebix Insurance Broking Private Limited for conducting Insurance Broking business where BSE holds equity stake of 40% through its subsidiary BSE Investments Limited. The regulatory approval from Insurance Regulatory and Development Authority of India (IRDA) for the same is awaited . \u00a0 Dividend \u00a0 BSE has paid final dividend of  Rs  25 per equity share of face value of  Rs  2 each on July 17, 2019. \u00a0  After taking into account the interim dividend of  Rs  5 per equity share paid in the month of December 2018, the total dividend paid for the financial year was  Rs  30 per equity share of face value of  Rs  2 each. The dividend payout ratio for financial year 2018-19 was 97%. \u00a0 Buyback of equity shares \u00a0 BSE also proposes to buyback 67.65 lakhs fully paid up equity shares of Rs 2 each at Rs 680 per equity share through tender offer route. The number of shares proposed to be bought back represents 13.06% of the total paid-up equity capital of the Company. The total amount of buyback size would be maximum of Rs 460 crore. \u00a0\u00a0  The Buyback offer size represents 24.73% of the aggregate of the total paid up capital and free reserves of the Company based on the standalone audited financial statements of the Company as at March 31, 2019. \u00a0  BSE has already filed its Draft Letter of Offer with respect to same on July 22, 2019 and is in process of providing certain additional documents and information as required. \u00a0 \u00a0 \u00a0 Commenting on financial performance for the quarter ended, Shri Ashishkumar Chauhan, MD & CEO, said:  \u201c Interoperatibility has been implemented recently. Some of the newer business have also started contributing to the revenues significantly. StAR MF platform\u2019s achieving contribution of 11% to the revenue from operations in a short period of past 2 years is a demonstration of the success of BSE\u2019s \u00a0  strategy to focus and grow by expanding into segments other than equity and into distribution activities. \u00a0  BSE would continue to focus on strengthening current business activities and new initiatives to monetize each such initiatives appropriately at opportune times and grow its revenue base.\u201d \u00a0\u00a0\u00a0  \u00a0 About BSE \u00a0 BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 Media Contact Yatin Padia 022 2272 8516 yatin.padia@bseindia.com \u00a0", "size": 224336, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.22940587997436523, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:30", "resp_headers_content-length": "224336", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in https://adservice.google.com  https://securepubads.g.doubleclick.net https://j.marketsmojo.com https://www.googletagservices.com  https://www.googletagmanager.com https://chatbot.bseindia.com https://streamlive.bseindia.com https://apis.google.com    'self' 'unsafe-inline' 'unsafe-eval' data: pagead2.googlesyndication.com storage.googleapis.com googleads.g.doubleclick.net ajax.googleapis.com; ;   connect-src * data: blob: filesystem:;   style-src *.gstatic.com *.google.com https://*.bseindia.com https://cdn.ampproject.org/ https://c.marketsmojo.com https://fonts.googleapis.com  https://chatbot.bseindia.com  'self'  data: chrome-extension-resource: 'unsafe-inline' *.gstatic.com *.google.com  pagead2.googlesyndication.com storage.googleapis.com googleads.g.doubleclick.net ajax.googleapis.com;  frame-src https://*.bseindia.com *.gstatic.com *.google.com https://www.youtube-nocookie.com/ https://www.youtube.com/  https://directline.botframework.com/ https://chatbot.bseindia.com/ https://chatbot.bseindia.com/ https://*.googlesyndication.com/ https://secureframe.doubleclick.net/ 'self' data: chrome-extension-resource:;  font-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://fonts.gstatic.com 'self' data: chrome-extension-resource: *.bseindia.com *.gstatic.com *.google.com fonts.googleapis.com; frame-ancestors 'self'; object-src 'self';  media-src * data: blob: filesystem:;worker-src 'self' 'unsafe-inline' * blob:", "resp_headers_content-type": "text/html; charset=utf-8", "resp_headers_date": "Fri, 04 Nov 2022 06:00:30 GMT", "resp_headers_feature-policy": "vibrate 'Self'; usermedia *; sync-xhr 'self'", "resp_headers_referrer-policy": "no-referrer | same-origin | origin | strict-origin | no-origin-when-downgrading", "resp_headers_server": "", "resp_headers_strict-transport-security": "max-age=31536000; includeSubDomains; preload", "resp_headers_x-content-type-options": "nosniff", "resp_headers_x-frame-options": "SAMEORIGIN", "resp_headers_x-xss-protection": "1; mode=block", "request_headers_accept": "text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8", "request_heade