{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=fbc0a6a8-52d5-4b72-9611-90666ebb8e53", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release \u00a0 Media\u00a0 Release\u00a0  Golden spice, turmeric makes it to BSE\u2019s commodity derivatives segment \u00a0 Sangli, June 28, 2019:  BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds, today commenced commodity derivatives trading in turmeric with a lot size of 10 metric tons.  \u00a0 The launch of turmeric futures was done in the Turmeric City of Maharashtra-Sangli. The event witnessed immense support from the turmeric traders of the city. \u00a0 Shri Ashishkumar Chauhan, MD & CEO, BSE\u00a0 said, \u201cLaunch of trading in turmeric contracts is in line with our long-term vision to introduce various Agri/non-Agri commodities contracts on BSE platform. We strongly believe there is a lot of scope for growth in the commodities market and look forward to launching more agri commodities and providing effective risk hedging instruments using the latest technology and risk management framework to all Indian stakeholders.\u201d \u00a0 The exchange has fixed a trading and delivery of 10 MT. The basic delivery centre for the turmeric contracts is Nizamabad (up to the radius of 100 Km from the municipal limits)  \u00a0 with additional delivery centres at Sangli, Erode, and Basmat (up to the radius of 100 Km from the municipal limits) with location wise premium/discount as announced by the Exchange. \u00a0 BSE has tied up with various agricultural premier associations and warehouse service providers in India for the growth and development of commodity derivatives markets in the agricultural complex. BSE had also entered into a licensing agreement with the London Metal Exchange and associated with Bombay Metal Exchange for base metal contracts, besides tying up with the Rajkot Commodity Exchange, Federation of Indian Spice Stakeholders, Soybean Processors Association of India and Cotton Association of India to launch agri commodities. \u00a0 \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.  \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/mihir.dani@adfactorspr.com/\u00a0shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0", "size": 39255, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.22914838790893555, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "39255", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://ww