{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=06ff7df4-f0a1-489a-8739-0ef5b98a10fa", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "h2": "Media Release", "body_text": "Media Release Media Release ICCL leads the way in interoperability; clears trades from BSE, MSE BSE and ICCL implement SEBI\u2019s interoperability framework; go live from June 3, 2019 Mumbai, June 3 2019:   BSE, Asia\u2019s oldest exchange and now the world\u2019s fastest exchange with the speed of 6 microseconds and ICCL, one of the leading Clearing Corporations in the world, have gone live and implemented interoperability framework starting from June 3, 2019. This is as per the market regulator SEBI\u2019s guidelines  to put in place the required infrastructure for operationalizing interoperability. SEBI, vide circular CIR/MRD/DRMNP/CIR/P/2018/145 dated November 27, 2018, had laid down the broad guidelines for operationalizing the interoperable framework among Clearing Corporations, which was required to be operationalized by Stock Exchanges and Clearing Corporations by June 1, 2019. BSE and ICCL had deployed the new Interoperability system on Saturday, June 1, 2019. Monday, June 3, 2019 was the first trading day after implementation of Interoperability; during the day, ICCL received and cleared multiple trades from BSE and MSE.  To ensure that the transition to interoperability is seamless and non-disruptive, it was jointly decided by all Stock Exchanges and Clearing Corporations that members can choose a functional date for going live with Interoperability on any Monday from June 3, 2019 till July 1, 2019.  15 clearing members at ICCL opted for Interoperability to be effective from June 3, 2019 and for such members, ICCL cleared trades for such members executed on exchanges that were connected to the Interoperability framework. \u00a0\u00a0\u00a0  Mr. Ashishkumar Chauhan, MD &CEO, BSE, said, \u201c We thank SEBI for conceptualising  \u00a0\u00a0 the world class interoperability framework. It will reduce the requirement for funds as well as reduce risk on the overall system when all the stock exchanges and clearing corporations become interoperable  \u00a0 making Indian stock market  \u00a0 more robust .\u201d  Ms. Devika Shah, MD&CEO, ICCL said,  \u201cInteroperability will bring down cost of clearing substantially for members with netting benefits, bring efficiency in margins, collateral, clearing and settlement, while bringing down the systemic risk.\u201d Mr. Balu Nair, Interim CEO, MSE & MD, MCCIL said  \u201cMSE is proud to have the first trade being clocked in the Interoperability environment in India, in its Equity Cash Segment. MSE & MCCIL believes this as the beginning of a large reform in Indian Capital Market.  \u00a0 We are thankful to our regulator SEBI for the constant guidance and support. We are also thankful to all MIIs, business partners, technology partners, and members for their support to launch interoperability services as per regulatory timelines. \u00a0 About BSE \u00a0 BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.\u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg).\u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.\u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 About ICCL Indian Clearing Corporation Limited (\"ICCL\") was incorporated in 2007 as a wholly owned subsidiary of BSE Ltd. (\"BSE\"). ICCL carries out the functions of clearing, settlement, collateral management and risk management for various segments of BSE. ICCL undertakes to act as the central counterparty to all the trades it provides clearing and settlement services for. \r\n \r\n ICCL settles trades reported on the Indian Corporate Debt Segment and the Mutual Fund (\"StAR MF) Segment of BSE and clears and settles trades executed on all the other segments of BSE, including Equity Cash, Equity Derivatives, BSE SME, Offer for Sale, Securities Lending & Borrowing, Debt Segment, Interest Rate Futures and the Currency Derivatives Segment. \r\n \r\n ICCL has been accorded Qualified Central Counterparty (\"QCCP\") status by the Securities and Exchange Board of India (\"SEBI\"). A QCCP member is subjected to lower capital requirements/charges under the Basel III Framework introduced by the Basel Committee on Banking Supervision. The capital requirements for Banks and Primary Dealers in India, for a QCCP like ICCL is subject to the Capital Adequacy Standards and Risk Management Guidelines for Standalone Primary Dealers as prescribed by the Reserve Bank of India (\"RBI\"). ICCL, as a Qualified CCP, is additionally required to comply with the rules and regulations that are consistent with the Principles for Financial Market Infrastructures (\"PFMI\") issued by the Committee on Payment and Settlement Systems (\"CPSS\") and International Organisation of Securities Commissions (\"IOSCO\").These rules and regulations focus on limiting systemic risk and on enhancing transparency and stability in the financial market. A clearing member registered with a QCCP like ICCL will be a beneficiary of the enhanced risk management framework of ICCL and will also benefit in the form of lower capital costs.\u00a0 \r\n \r\n ICCL is the only clearing corporation in India to have been granted \"AAA\" rating by two rating agencies, India Ratings Ltd. (Indian arm of Fitch Ratings) and Care Ratings Ltd. \r\n \r\n ICCL has established a robust Risk Management framework which utilises a Value at Risk model for margining of Equity Cash Segment and a risk based SPAN model for all its derivatives transactions, viz. equity derivatives, currency derivatives and interest rate derivatives. ICCL aims to provide secure, capital-efficient counterparty risk management and post-trade services. \r\n \r\n 20 banks have been empanelled as Clearing Banks for providing clearing and settlement services for trades executed on the BSE platform; the aggregate lines of credit being more than the average daily funds pay-out. \r\n \r\n ICCL remains committed to the safety of investors and members and to further add to this security, ICCL has subscribed to a unique Insurance Policy for INR 375 Crore. The objective of the Policy is to protect ICCL against counterparty defaults and add a further capital cushion to the ICCL networth making the resources of the non-defaulting members even safer. \u00a0 About MSE  Since its inception in 2008, MSE\u2014the third national stock exchange\u2014is committed to encouraging broader participation in equity and growing the non-equity segment(s). On the anvil are a slew of differentiated products, some likely to be the first in the Indian market. The product positioning of MSE shall be complemented by reduced operating cost for members, better utilization of their capital and technology upgrade. Metropolitan Stock Exchange of India offers a transparent, hi-tech platform for trading in Capital Market, Futures & Options (F&O), Interest Rate Derivatives, Currency Derivatives, ETFs and Debt Market. At present, 245 companies are listed on the exchange, and about 1,300 large corporates are available for trading in the permitted to trade category.  About MCCIL  Metropolitan Clearing Corporation of India Limited (MCCIL) is a subsidiary of Metropolitan Stock Exchange of India Ltd. (MSE), a new age Clearing Corporation constituted to undertake clearing and settlement of deals in multi-asset classes. The company offers bestin-class services to its clearing members with the help of its state of the art risk management framework and unparalleled clearing and settlement systems with dedicated linkages with clearing partners.  The company commenced its operations on February 16, 2009, with clearing and settlement of trades for MSE. From October 1, 2018, MCCIL also started its clearing services for ICEX, thereby becoming the only SEBI recognized clearing corporation to provide services for multiple exchanges and multiple asset classes. MCCIL has an impeccable track record of having completed all settlements from the date of commencement of its operations in a timely manner without defaults.  MCCIL is designated as a Qualified Central Counter Party (QCCP) by the SEBI. MCCIL is recognized by ESMA as a Third Country Central Counter Party. MCCIL is also recognized by Bank of England as Third Country Central Counter Party that will offer clearing services and activities in the United Kingdom under Temporary Recognition Regime (TRR) of the Central Counterparties (Amendments, etc., and Transitional Provision) (EU Exit) Regulations 2018. \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh \r\n022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 \r\nYatin.padia@bseindia.com / Rahul.vyas@indiainx.com /  mihir.dani@adfactorspr.com/  shruti.nitesh@adfactorspr.com \u00a0 \u00a0", "size": 56854, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.48632335662841797, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "40502", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in https://adservice.google.com  https://securepubads.g.doubleclick.net https://j.marketsmojo.com https://www.googletagservices.com  https://www.googletagmanager.com https://chatbot.bseindia.com https://streamlive.bseindia.com https://apis.google.com    'self' 'unsafe-inline' 'unsafe-eval' data: pagead2.googlesyndication.com storage.googleapis.com googleads.g.doubleclick.net ajax.googleapis.com; ;   connect-src * data: blob: filesystem:;   style-src *.gstatic.com *.google.com https://*.bseindia.com https://cdn.ampproject.org/ https://c.marketsmojo.com https://fonts.googleapis.com  https://chatbot.bseindia.com  'self'  data: chrome-extension-resource: 'unsafe-inline' *.gstatic.com *.google.com  pagead2.googlesyndication.com storage.googleapis.com googleads.g.doubleclick.net ajax.googleapis.com;  frame-src https://*.bseindia.com *.gstatic.com *.google.com https://www.youtube-nocookie.com/ https://www.youtube.com/  https://directline.botframework.com/ https://chatbot.bseindia.com/ https://chatbot.bseindia.com/ https://*.googlesyndication.com/ https://secureframe.doubleclick.net/ 'self' data: chrome-extension-resource:;  font-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://fonts.gstatic.com 'self' data: chrome-extension-resource: *.bseindia.com *.gstatic.com *.google.com fonts.googleapis.com; frame-ancestors 'self'; object-src 'self';  media-src * data: blob: filesystem:;worker-src 'self' 'unsafe-inline' * blob:", "resp_headers_content-type": "text/html; charset=utf-8", "resp_headers_date": "Fri, 04 Nov 2022 06:00:30 GMT", "resp_headers_feature-policy": "vibrate 'Self'; usermedia *; sync-xhr 'self'", "resp_headers_referrer-policy": "no-referrer | same-origin | origin | strict-origin | n