{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=74159a98-2503-4eb4-87da-7a6f63b37edf", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release Action taken by BSE against Companies for Non-compliance with Listing Regulations Mumbai, Wednesday, 15 May 2019:   SEBI vide circular dated May 3, 2018 (ref no. SEBI/HO/CFD/CMD/CIR/P/2018/77) has specified uniform approach i.e. Standard Operating Procedure ('SOP\u2019) in the matter of levy of fines for non-compliance with certain provisions of SEBI (Listing Obligations and Disclosure Requirements) Regulations, 2015 (\u2018Listing Regulations\u2019).  Based on the SOP, Exchanges are required to scrutinize the periodic compliance filings submitted by the Listed Companies and take action for non-compliance, as laid out in the SEBI SOP Circular.  \u00a0 Such penal actions include levy of fines for every day of non-compliance, freezing of promoter holdings and finally, suspension of trading in the securities of the companies which are non-compliant for consecutive quarters. Based on filings received by the BSE from the Companies for the quarter ended March 31, 2019, BSE has levied penalties against various companies for late or non-submission of filings and non-compliance with Corporate Governance requirements.  \u00a0 The statistics of such companies for the quarter ended March 31, 2019 is as follows: -  \u00a0 1) \u00a0\u00a0\u00a0  Late Submission / Non-submission of Shareholding Pattern: - 121 2) \u00a0\u00a0\u00a0  Late Submission / Non-submission of Corporate Governance Report: - 92 3) \u00a0\u00a0\u00a0  Late Submission / Non-submission of Investor Complaints Report: -124 4) \u00a0\u00a0\u00a0  Non-compliance with Board Composition: - 173 5) \u00a0\u00a0\u00a0  Non-compliance with Audit Committee Composition: - 104  6) \u00a0\u00a0\u00a0  Non-compliance with Nomination and Remuneration Committee Composition: - 122 7) \u00a0\u00a0\u00a0  Non-compliance with Stakeholder Relationship Committee Composition: - 72 8) \u00a0\u00a0\u00a0  Non-compliance with requirement to appoint a qualified company secretary as the compliance officer: - 515 9) \u00a0\u00a0\u00a0  Non-compliance with requirement to appoint share transfer agent: - 68 \u00a0 The Company-wise details are displayed on the BSE website at  https://www.bseindia.com/static/corporates/SEBI_SOP_circular.html   The Listed Companies are once again urged to ensure timely compliance with the Listing Regulations to avoid penal actions. Media Contact: Yatin Padia / Rahul Vyas  022 2272 8516 / 2272 8472  Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com \u00a0", "size": 34823, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.20761656761169434, "depth": 0, "status": 200, "links_url": "https://www.bseindia.com/static/corporates/SEBI_SOP_circular.html", "links_text": "https://www.bseindia.com/static/corporates/SEBI_SOP_circular.html", "links_nofollow": "False", "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "34823", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.d