{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=40ec87e4-58d5-4aab-b2aa-4684fe58dbdd", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release BSE launches BSE StAR MF app to provide comfort of doing business anytime, anywhere! Mumbai, May 15, 2019 : \u00a0  BSE StAR MF, India's largest Mutual Funds Distributor platform, launched its mobile app - \u2018BSE StAR MF\u2019 - on May 15, 2019 at BSE International Convention Hall, Fort, Mumbai. The newly-launched app would look at enabling more participation from Mutual Fund Distributors (MFDs) by helping them process transactions on the go! The app would further ease the process of purchase and redemption of mutual fund units on behalf of their clients.  \u00a0 BSE StAR MF Mobile app supports real-time client registration and paperless transactions, creates and uploads mandate for SIPs, generates the basket of multiple of orders, tracks and allows the distributor to analyse his business at his fingertips. \u00a0 In April 2019, the platform processed 42.6 lakh transactions. In FY2018-19, BSE StAR MF crossed 3.5 crore transactions witnessing 111% growth as compared to 1.70 crore transactions in FY2017-18. \u00a0 Commenting on the launch of BSE StAR MF app, BSE MD & CEO, Ashishkumar Chauhan  said, \u201cBSE StAR MF platform has become a benchmark for the fintech industry in India by e-enabling more than 24,000 direct IFAs and 200,000 indirect IFAs to automate end to end processes in their front and back offices. The launch of the app would further provide comfort of doing business to our 24,000 members. This app would not only increase their productivity, but would also enable IFAs to take their business anywhere, anytime. BSE StAR MF has seen more than 100% year on year growth every year for last 10 years consistently. With the launch of the app, we look forward to help IFAs grow their business and retain the No. 1 position in the online MF distribution platform segment. This mobile application will also be provided to individual investors shortly.\u201d \u00a0 Overall, the superior support system and distribution reach of BSE StAR MF has enabled the platform to grow exponentially with the registered distributors soon to touch 24,000 in India. The launch of the StAR MF app is expected to further increase the number of distributors significantly. In future, the app aims to support online video KYC to onboard new investors. \u00a0  The  BSE StAR MF  app can be  downloaded from Google Play Store. Once the app is downloaded, the sign up can be done by providing the member identification number. \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 Media Contact: Yatin Padia / Rahul Vyas  022 2272 8516 / 2272 8472  Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com \u00a0", "size": 29379, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.24112844467163086, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "29379", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads