{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=adcecd2e-76d4-4a2f-9709-9fdfbcc3cc64", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release \u00a0 BSE StAR MF app processes over 10,000 transactions in a month; clocks 101 cr \u00a0 Mumbai, June 18, 2019 : BSE\u2019s newly-launched BSE StAR MF app has processed over 10,000 transactions in a month (May 15 th  - June 15 th ), amounting to Rs 101 cr. The app was launched to help the IFAs (Independent Financial Advisors) to register clients on real-time basis and execute paperless transactions. \u00a0 The self-explanatory and easy to transact app creates and uploads mandate for SIPs, generates the basket of multiple of orders, tracks and allows the distributor to analyse his business on the go. \u00a0 Commenting on the milestone,  BSE MD & CEO, Shri Ashishkumar Chauhan , said, \u201cThe growing users on the app are testimony to BSE\u2019s ability to offer comfort of doing business to its members that would not only increase their productivity, but would also enable IFAs to take their business anywhere, anytime. We look forward to more users leveraging the BSE StAR MF app and taking their business to a new level altogether.\u201d \u00a0 More than 200,000 distributors are working on BSE StAR MF platform of which close to 25,000 distributors are direct IFAs. BSE also plans to provide the mobile application to individual investors shortly. BSE StAR MF accounts for 20% of all MF transactions and 40% of all new subscribers to MF industry. On June 10, 2019, the exchange set a new record by crossing over 7.62 lakh transactions in a day. \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/mihir.dani@adfactorspr.com/ shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u0