{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=495c7bd2-eed9-4983-a72c-eacfac6b499c", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release \r\n Media Release \r\n \u00a0 \r\n BSE ties up with Network Intelligence to provide security services to its members under the SEBI Cybersecurity Guidelines \r\n \u00a0 \r\n Mumbai, April 15, 2019 :  BSE, India\u2019s largest stock exchange has entered a Memorandum of Understanding (MoU) with Network Intelligence, a global cybersecurity services provider & CERT-IN empanelled vendor to provide cybersecurity services to its members in line with the cybersecurity framework set by SEBI.  \r\n \u00a0 \r\n In late 2018, SEBI had released its \u201cCybersecurity & Cyber Resilience framework for Stock Brokers / Depository Participants\u201d. \u00a0  After a detailed assessment and capabilities evaluation by BSE, Network Intelligence India (NII) was selected as one of its partners to provide these services to its members.  \r\n \u00a0 \r\n Network Intelligence will be using its own developed platform \u2013 BlueScope\u00a9 to offer 24x7 cyber security operations to the members. In addition, Network Intelligence, will be using leading technology solutions to provide other services including VAPT, Asset Management, Endpoint Security, Network Security etc. All the activities will be conducted from its state-of-the-art Next Gen Cybersecurity Operations Centre (CSOC) based in Mumbai.  \r\n \u00a0 \r\n Commenting on the development,\u00a0 Shri Ashishkumar Chauhan, CEO BSE , said, \u201cOur aim is to safeguard the interests of our stock brokers and robust cyber security in place. By associating with Network Intelligence, who are the leaders in cyber security services and solutions, we aim to strengthen the cyber security framework, tackle all the challenges pertaining to capital markets ecosystem and adhere to SEBI\u2019s guidelines to protect the integrity of data and guard against breaches of privacy.\u201d \r\n \u00a0 \r\n Earlier, BSE had associated with John Chambers\u2019 backed Lucideus to secure stock brokers as per SEBI guidelines using SAFE. The SAFE platform integrates with the existing technology stack of an enterprise to provide a real-time cyber risk assessment (a number between 0-5) at a macro level across the organization that can be broken down into micro-level scoring individually for each asset. It considers controls across people, process and technology.\u00a0 \r\n \u00a0 \r\n K K Mookhey, Founder & CEO of Network Intelligence  said, \u201cBFSI industry is the backbone of our economy. We welcome the steps taken by SEBI & BSE in addressing the need to protect the entire eco-system against the ever-increasing cyber threat landscape. BFSI customers contribute to more than 60% of our business. We are well versed with the setup and understand what needs to be done. Off late, we have seen a lot of targeted attacks in this vertical. Our partnership with BSE, will enable us to play an important part in providing specialized cybersecurity monitoring, detection and incident response capabilities to its members.\u201d  \r\n About BSE \r\n BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.\u00a0 \r\n \u00a0 \r\n BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \r\n \u00a0 \r\n BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.\u00a0 \r\n \u00a0 \r\n Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.\u00a0 \r\n About Network Intelligence:  \r\n \u00a0 \r\n Network Intelligence is a global cybersecurity services provider founded in 2001. We have more than 600 team members and offices across the globe. We offer services across 6 broad spectrums i.e. Assessment, GRC, Professional Services, MSSP, Technologies & Cybersecurity Trainings. \u00a0 Our experience and expertise cover industry verticals such as Banks and Financial Services, Technology and Media, Oil & Power, Airlines, E-commerce portals, Retail, etc.\u00a0   We believe that cybersecurity is not a destination, it is a journey and we partner with our clients to address the dynamic cybersecurity threat landscape.   Contact us at \u00a0 info@niiconsulting.com \u00a0 or visit:\u00a0 \u00a0 https://www.niiconsulting.com/ \r\n \u00a0 \r\n Media Contact: \r\n Yatin Padia / Rahul Vyas  \r\n 022 2272 8516 / 2272 8472  \r\n Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com \r\n \u00a0 \r\n \u00a0", "size": 53273, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.24282169342041016, "depth": 0, "status": 200, "links_url": "http://iisecurity.benchurl.com/c/l?u=86D64EF&e=DD1BD1&c=187D0&t=1&l=10F93852&email=Wj%2BHKzEVZH2YIvdtWEQ0L7tPyQq1nWIwJRERH6YsAZk%3D&seq=1", "links_text": "https://www.niiconsulting.com/", "links_nofollow": "False", "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "53273", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com