{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=b087798b-0091-40d5-9842-36ba475c67d5", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release \u00a0 BSE resolved 51 investor\u2019s complaints against companies during the month of April 2019 \u00a0 Mumbai: May 03, 2019 : During the month, BSE received 84 complaints against 76companies. In the same period 51 complaints were resolved against 47 listed companies. These resolved complaints include complaints brought forward from the previous periods. \u00a0 \r\n Type of complaints Complaints received Complaints resolved \u00a0 Against Active Companies Against Suspended Companies Total Against Active Companies Against Suspended Companies Total I 5 0 5 0 0 0 II 20 0 20 19 0 19 III 1 0 1 0 0 0 IV 30 0 30 22 1 23 V 0 0 0 0 0 0 VI 23 5 28 9 0 9 Total 79 5 84 50 1 51 \u00a0 The complaints received by BSE from Investors have been categorized as under: \u00a0 \r\n Type I Non-receipt of money (Refund, Interest, Redemption, Fractional Entitlement.) Type II :\u00a0 Non-receipt of Equity shares ( Demat & Physical : In Public/Rights issue, Remat, Transfer, Transmission, Conversion / Endorsement / Consolidation/ Splitting / Duplicate Certificate) Type III Non-receipt of Debt Securities ( Demat & Physical : In Public/Rights issue, Remat, Transfer, Transmission, Conversion / Endorsement / Consolidation/ Splitting / Duplicate Certificate) Type IV Non-receipt of Corporate benefits / entitlements ( Dividend, Bonus, Rights form, \u00a0Buyback letter of offer, Delisting letter of offer, Annual Report ) Type V Non-receipt of Interest for delay in : ( Refunds, Dividend, Interest on debt security, Redemption of debt security , Securities ) Type VI Others ( Including Non-Adherence to Corporate Governance Norms ) \u00a0 Companies with highest number of complaints pending as on 30 th 