{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=4fe5552a-eaf4-4f53-815b-e3fde114c253", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release  \u00a0 BSE becomes the first exchange in India to witness delivery of 1000 MT in a first month of any commodity contract \u00a0 Mumbai, April 3 rd , 2019: \u00a0  BSE India\u2019s first stock exchange and now world\u2019s fastest exchange with the speed of 6 microseconds has crossed milestone with the first-ever delivery of 1200 MT of its Guar Seed and Guar Gum futures contract. A successful pay-in and pay-out of the contract concluded today for the above quantity. The delivery demonstrates the confidence of participants in BSE in the first month of its operations. BSE is in the process of adding many more agri contracts in its list of products.\u00a0 \u00a0 BSE launched Guar Seed and Guar gum contracts on February 7th, 2019 and since then it has been gaining momentum. Guar seed had witnessed highest Market-Share of 43% and highest turnover of 131crs in first 15 days of its launch. \u00a0 For Gaur Seed, there were four sellers and one buyer, whereas for Guar Gum there were two buyers and one seller. \u00a0 \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 yatin.padia@bseindia.com / rahul.vyas@indiainx.com / mihir.dani@adfactorspr.com / shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u00a0 \u00a0", "size": 28398, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.1734161376953125, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "28398", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2