{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=73decb0c-aeab-48a1-bce2-2847dd1b2754", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release \u00a0 BSE becomes India\u2019s first ever stock exchange to get certified with International Standard for Business Continuity Management System (ISO22301:2012) BCMS \u00a0 Mumbai: May 13, 2019:  BSE, Asia\u2019s oldest exchange and now the world\u2019s fastest exchange with the speed of 6 microseconds has become India\u2019s first ever stock exchange to get certified with International Standard for Business Continuity Management System (ISO22301:2012) BCMS. \u00a0 BSE has been accredited with ISO 22301:2012 certification for Business Continuity Management Standard (BCMS) by DNV GL, an international accredited registrar and classification society headquartered in H\u00f8vik, Norway. This certificate was presented to Shri Ashishkumar Chauhan, MD & CEO, BSE, by Shri Prakash Tikare, Country Head-India, DNV GL on 7th May 2019. \u00a0 Shri Prakash Tikare congratulated BSE and its team for the certification and said , \u201cBSE has very matured Information Security Management System (ISO 27001) in place over the years and now with the implementation of Business Continuity Management System (ISO 22301), BSE has taken an important step forward. DNV GL is proud to be partnered with BSE in this program and wish BSE and its team all the very best.\u201d  \u00a0 He added that BSE is a national pride and symbol and that the certification will present a formal assurance to all stakeholders of BSE about existence of Management System with the ability to sustain interruptions against business. He also appreciated the state-of-art setup of 24X7 Next Generation Cybersecurity Operations Centre, as a strong measure against cyber threats to sustain business. \u00a0 Shri Ashishkumar Chauhan, MD & CEO, BSE  congratulated all BSE teams for the pioneering achievement and stated that the certificate represent the management and the team\u2019s commitment to its customers and stakeholders. He said that the implementation of the standard is in a manner that is aligned with its strategic and operational objectives as well. This is a proactive step on BSE's behalf to provide its customers with assurance that the exchange has a management system to ensure continuity of business in situation of disruption or disaster.  \u00a0 This certification further evidences the commitment and high quality of the services provided by BSE and its constant alignment to legal and regulatory requirements of SEBI governing its operations and business. \u00a0 \r\n \r\n     \r\n         \r\n             \r\n             \r\n             Photo Caption:  Mr. Prakash Tikare, Country Head-India, DNV GL, BSE presented the ISO 22301:2012 certification for Business Continuity Management Standard to Mr. Ashishkumar Chauhan MD & CEO, BSE, Mr. Kersi Tavadia, CIO, Mr. Shivkumar Pandey, CISO, BSE  \r\n             \r\n             \r\n         \r\n     \r\n \r\n \u00a0 \r\n\u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.\u00a0 \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.\u00a0 \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.\u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/mihir.dani@adfactorspr.com/\u00a0shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u00a0", "size": 63580, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.5520496368408203, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "48201", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma