{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=eb873cfa-c18e-4650-bcd5-2e66356e63d9", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release BSE inks pact with HDFC Bank to give a boost to the Startups platform \u00a0 \u00a0 Mumbai, April 08, 2019:  With an aim to further strengthen the BSE Startups platform, BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds, has signed a memorandum of understanding (MoU) with HDFC Bank. The MoU has been signed to spread more awareness on the benefits of listing on BSE Startups on this platform.  \u00a0 BSE had launched the Start Up platform on December 22, 2018 with an aim to encourage entrepreneurs to get listed and raise equity capital for their growth and expansion.  \u00a0 Benefits \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Develop awareness of BSE's Startup platform amongst HDFC Bank's portfolio of startups. Also, extend value-added support for eligible startups, along with BSE for the listing \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Offer Banking and Lending solutions to eligible start-ups already listed or due-to-list on BSE Startup platform \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Ability to access capital via BSE's Startup platform in turn will enable startups to access growth capital and enhance tradability of an otherwise illiquid/ high-risk investment asset class. \u00a0 Commenting on the collaboration,  Shri Ajay Kumar Thakur, Head BSE SME & Start Up said , \u201c BSE is the first exchange to have launched the Start Up platform. The idea was to help entrepreneurs\u00a0look beyond the conventional channels of raising capital and enable them to list on the stock exchange to further enhance the credibility of the firm. While we have conducted numerous seminars in Tier 1, 2 and 3 cities on the benefits of listing on the BSE Start Up platform, we believe by associating with a leading bank like HDFC that boasts of a large network, presence and Start up base would enable more firms to choose our platform and raise funds as well as improve productivity.\u201d \u00a0 Commenting on the association,  Ms Smita Bhagat, Country Head \u2013 Government, e-commerce and Start-ups, HDFC Bank,  \u201cThis is part of our commitment to the larger cause of strengthening the Startup community/ecosystem in the country. Startups are today reimagining and reshaping the world we live in. We are already partnering with them by mentoring them and giving them a chance to work with us. We are extremely happy to reinforce our commitment to them through this partnership with BSE\u201d.  \u00a0 \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 \u00a0 About HDFC Bank \u00a0 With 43 million customers, 5000 branches and 13,160 ATMs across 2,727 Indian towns and cities, HDFC Bank is one of India\u2019s premier banks. Promoted by Housing Development Finance Corporation (HDFC), India's leading housing finance company in 1995, the Bank is widely regarded for its use of technology and ability to provide world-class services. Over the past 24 years, it has successfully gained market share in its target customer franchises, even as it maintained healthy profitability and asset quality.  \u00a0 The Bank\u2019s achievements have been consistently recognised in numerous prestigious surveys and awards. The latest in the coveted list being Bank of the Year and Best Large Bank awards in the Business Today India\u2019s Best Banks Survey, 2019. \u00a0 For information please log on to:  www.hdfcbank.com \u00a0 \u00a0 \u00a0 For media queries please contact: Rajiv Banerjee   Vice President, Corporate Communications, HDFC Bank Ltd, Mumbai.  Tel: 9 -22-66521307 (D)/6652 1000 (B) Mobile: 09920454102  rajivshiv.banerjee@hdfcbank.com \u00a0 Yatin Padia / Rahul Vyas  022 2272 8516 / 2272 8472  yatin.padia@bseindia.com / rahul.vyas@indiainx.com \u00a0 \u00a0", "size": 62531, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.41026830673217773, "depth": 0, "status": 200, "links_url": "http://www.hdfcbank.com/", "links_text": "www.hdfcbank.com", "links_nofollow": "False", "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "42280", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in https://adservice.google.com  https://securepubads.g.doubleclick.net https://j.marketsmojo.com https://www.googletagservices.com  https://www.googletagmanager.com https://chatbot.bseindia.com https://streamlive.bseindia.com https://apis.google.com    'self' 'unsafe-inline' 'unsafe-eval' data: pagead2.goo