{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=3bd3f041-3cc3-4336-9838-29cf5c3ebb66", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release  \r\n \r\nBSE becomes the largest exchange in Cotton trading in India with over 50% market share in less than 12 working days  \u00a0 Mumbai, March 8, 2019: BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds, sets another record to become the leader in the cotton trading exchange with over 50% market share in March contract total 3307 lots were traded of 82,675 bales on a single day valuing to Rs 173 crores\u00a0 . BSE began trading in cotton contracts on 18th February, 2019 after getting Sebi's nod to launch the natural fibre on their commodity derivatives exchange. BSE is also offering a waiver in the transaction charges for the initial year. Commenting on the milestone, Mr. Ashishkumar Chauhan, MD & CEO, BSE said, \u201cDuring the launch, we were looking forward for cotton futures contract to witness a remarkable rise in terms of volumes and simultaneously emerge as the most compliant exchange in commodities. It\u2019s a proud moment for us to have achieved this milestone in just less than 12 working days and I would also like to thanks Cotton Association of India for their support.\u201d The commodity can be traded from Monday to Friday between 9.00am to 9.00pm.The unit of trading for the cotton contract is 25 bales and the deliveries will be tendered in 100 bales. The quotation for cotton futures is in Rs. per bale (of 170 kg). The basic delivery centre for the cotton contracts is Rajkot with additional delivery centres at Aurangabad, Jalgaon Yavatmal in Maharastra and Kadi in Gujarat. \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. Media Contact: Yatin Padia / Rahul Vyas /\u00a0Mihir Dani\u00a0/Shruti Nitesh 022 2272 8516 / 2272 8472 / \u00a0 7738012080 \u00a0/ \u00a08108000