{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=6e999711-80a1-4f9a-a809-e25e37377211", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release Indian Clearing Corporation Limited recognized by Bank of England \u00a0 Mumbai, March 22, 2019 : Indian Clearing Corporation Limited (\u201cICCL\u201d), the clearing arm of the oldest stock exchange in India, BSE, has received temporary recognition pursuant to the UK Statutory Instrument The Central Counterparties (Amendment, etc., and Transitional Provision) (EU Exit) Regulations 2018 (\u201cthe SI\u201d). The Temporary Recognition Regime (\u201cTRR\u201d) will enable ICCL to provide clearing services and activities in the UK for up to three years from the commencement of the TRR, extendable by HM Treasury in increments of twelve months. \u00a0 ICCL has also earlier received recognition as a Third Country Central Counterparty (\u201cTC-CCP\u201d) by the European Securities and Markets Authority (\u201cESMA\u201d) in accordance with the European Market Infrastructure Regulation (\u201cEMIR\u201d) in September 27, 2017. A TC-CCP recognised under the EMIR process also receives the Qualified Central Counterparty (\u201cQCCP\u201d) status across the European Union. \u00a0 In 2018, BSE, became the first stock exchange in India to receive Designated Offshore Securities Market (\u201cDOSM\u201d) recognition from the United States Securities and Exchange Commission (\u201cSEC\u201d) under Rule 902 (b) of Regulation S under the U.S. Securities Act of 1933, joining an elite list of foreign securities exchanges that have been recognized as DOSMs by the SEC. \u00a0 About ICCL ICCL is a wholly owned subsidiary of BSE and carries out the functions of clearing, settlement, collateral management and risk management for various segments of BSE. ICCL is a recognised clearing corporation under Regulation 4 and 12 of Securities Contracts (Regulation) (Stock Exchanges and Clearing Corporations) Regulations, 2018. ICCL is regulated by SEBI and the Reserve Bank of India (\u201cRBI\u201d), for select products. ICCL is the only clearing corporation in India to have been granted \"AAA\" rating by two rating agencies, India Ratings Ltd. (Indian arm of Fitch Ratings) and Care Ratings Ltd. ICCL aims to provide secure, capital-efficient counterparty risk management and post-trade services and has put in place a robust risk management framework to mitigate the risk it undertakes in its capacity as a clearing corporation. \u00a0 \u00a0 Media Contact Yatin Padia / Rahul Vyas 022 2272 8516 / 2272 8472 Yatin.padia@bseindia.com  /  Rahul.vyas@indiainx.com \u00a0 \u00a0", "size": 23172, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.23860931396484375, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:31", "resp_headers_content-length": "15128", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.c