{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=04948671-4750-480d-afd8-2a20addae4b5", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release \u00a0 \u00a0 Media Release  \u00a0 Bombay Stock Exchange Brokers Forum (BBF), Association of National Exchanges of Members of India (ANMI) and BSE join hands to contribute Rs. 54.30 lakhs to Bharat Ke Veer Corpus Fund \u00a0 Mumbai, 08 March 2019:\u00a0  Bombay Stock Exchange Brokers Forum (BBF) and Association of National Exchanges of Members of India (ANMI) along with BSE stand in solidarity with the families of Central Reserve Police Force (CRPF) martyrs. As a mark of gratitude, members associated with BBF and ANMI have jointly undertaken an initiative -'Bharat Ke Veeron Ke Naam Stock Market Ka Salaam'. BSE administered the process of collection of contributions from members and investors through its electronic aggregation platform from February 25, 2019 to March 5, 2019 and remittance of the same to Bharat Ke Veer Corpus Fund. BSE also offered everyone an opportunity to offer their tributes and post a video message. The shortlisted messages are played on its website. The employees of BSE and its group companies have also contributed their one-day salary for this cause. \u00a0 \u00a0As a part of this initiative, BSE, BBF and ANMI along with their members wholeheartedly contributed to \u201cBharat Ke Veer\u201d Corpus Fund, set up by Ministry of Home Affairs, Government of India and administered by the CRPF. The members of BBF and ANMI, along with investors contributed Rs. 37.91 lakhs as part of this initiative. The employees of BSE and it\u2019s group companies also contributed their one-day salary for this cause and contributed Rs. 16.39 lakhs. Jointly, as a part of this initiative, we have been able to raise Rs. 54.30 lakhs for our brave jawans. As a token of appreciation to all the contributors for this initiative, BSE ran a special ticker displaying the names of the contributors on its website from February 25, 2019. \u00a0 Expressing his grief and condolences to the families of the deceased jawans,  Shri. Ashishkumar Chauhan, MD & CEO, BSE  said, \u201cI am thankful to all the contributors who decided to support this noble cause. We stand fully in support of our armed forces and the government in expressing our gratitude to the jawans who laid down their lives in the service of our nation.\u201d \u00a0 Shri. Uttam Bagri, Chairman, Bombay Stock Exchange Brokers Forum,  said \"This is a small token of appreciation for our brave jawans and our real life heroes\"  \u00a0 \u00a0 S hri. Rajesh Baheti, President, ANMI  s aid, \u201cAll of us from ANMI stand by our country at such a testing time with the escalation of border skirmish. We deeply condole the death of the Veer Jawans recently - the great souls who laid down their lives to keep India safe. ANMI thanks each and every one who has contributed in support of families of our brave soldiers\u00a0of India.\u201d \u00a0 \u00a0 \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.  \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/mihir.dani@adfactorspr.com/\u00a0shruti.nitesh@adfactorspr.com \u00a0 \r\n \u00a0", "size": 47293, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.21674394607543945, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "47293", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age