{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=0110dc35-df17-41fe-8f9d-3da1a3072ae3", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release  Surat Municipal Corporation successfully raised Rs.200 Crore on BSE Bond Platform Mumbai: February 27, 2019:   BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds  on 1 st \u00a0July 2016 had launched the platform for Electronic Book Mechanism \u201cBSE BOND\u201d for issuance of debt securities on private placement basis.\u00a0 On February 27, 2019 Surat Municipal Corporation successfully raised Rs.200/- Crore by issuing Municipal Bond on Private Placement Basis using BSE- Bond. (EBP Platform)  Speaking on this occasion Shri Ashishkumar Chauhan, MD & CEO, BSE  said, \"I am happy that  Surat Municipal Corporation (SMC)  is able to raise Rs.200/- Crore successfully using the BSE Bond Platform, a market leading platform for bond raising in India.  \u00a0 Surat Municipal Corporation is the second Municipal Corporation to raise funds in the state of Gujarat after Ahmedabad Municipal Corporation this year. BSE firmly believes that Indian Bond Market is poised for a substantial growth and India can use its domestic savings to fund its infrastructure needs in a substantial manner.\" Dr. Jagdishbhai Patel, Mayor of Surat Municipal Corporation and Mr. M.Thennarasan IAS, Commissioner of Surat Municipal Corporation said, \"SMC is a fore runner in reforms by providing better civic amenities. The Benchmark of various services of Surat Municipal Corporation is much higher than eligible limits. \u00a0  We are extremely happy for the platform provided by BSE which enable us to raise Rs.200/- Crore at competitive rates against prevailing market yield for strategic upgradation and enhancement of sewerage treatment projects.\" The support, information, suggestions received by the esteem and well-mannered team of BSE enable us to tap the bond market very easily and it is our pleasure to have BSE Platform for our aforesaid successful bond issue. Media Contact Yatin Padia/ Rahul Vyas 022 2272 8516 / 2272 8472 Yatin.padia@bseindia.com   /Rahul.vyas@indiainx.com \u00a0", "size": 23252, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.1494898796081543, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "23252", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in https://adservice.google.com  https://securepubads.g.doubleclick.net https://j.markets