{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=eaf4d8ac-0950-4897-8f7f-0dc76895920d", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Bloomberg on-boards XBRL data from Bombay Stock Exchange \u00a0 First global data provider to process enhanced electronic document standard recently adopted by one of India\u2019s leading exchanges  \u00a0 Mumbai, March 13, 2019  \u2013 Bloomberg announced today that it has successfully on-boarded XBRL data exclusively from the Bombay Stock Exchange (\u201cBSE\u201d), resulting in significant benefits to market participants in the preparation, analysis and dissemination of business information. \u00a0 BSE is the first exchange in India to accept financial statements in the XBRL format, allowing for the extraction of data such as Shareholding Patterns, Financial Results, Voting Results, Corporate Governance data, as well as financial results from General and Life Insurance companies and Annual Reports. \u00a0 eXtensible Business Reporting Language (\"XBRL) is an electronic format for communication of business and financial data which offers major benefits to business reporting and analysis, resulting in better automation, cost control and more reliable data handling. The standard is widely used globally among financial regulators, stock exchanges, business registrars and listed companies. With implementation of XBRL, BSE has joined a growing number of international stock exchanges that have implemented XBRL based reporting. \r\n \r\n\u201cWe are pleased to be first in the market to capitalize on these new data sets provided by BSE,\u201d said Ashlesh Gosain, head of South Asia Sales at Bloomberg. \u201cOur clients will be able to leverage these rich data sets on our terminal, especially India\u2019s mid to micro-cap investors, who will see the timeliness and transparency of this data improve significantly. In addition, the available data for smaller companies has become much more robust and is now aligned with their larger counterparts, making disclosure levels more uniform across India\u2019s universe of listed companies.\u201d \u00a0 \u00a0 Nehal Vora, Chief Regulatory Officer at BSE added, \u201cBloomberg has been an invaluable partner in ensuring investors have the best tools and technology to invest in India\u2019s growing markets. By adopting this document format, we are ensuring that local and international investors are given the transparency to invest confidently in India\u2019s mid to small-cap businesses.\u201d \r\n On 18 February 2019, BSE announced that it  adopted the XBRL taxonomy published by the Ministry of Corporate Affairs, Government of India, for filing of Annual Reports by companies .  \u00a0 From the date of accepting filings in XBRL format, BSE has received more than 21,000 XBRL documents. \u00a0 About Bloomberg \u00a0 Bloomberg, the global business and financial information and news leader, gives influential decision makers a critical edge by connecting them to a dynamic network of information, people and ideas. The company\u2019s strength \u2013 delivering data, news and analytics through innovative technology, quickly and accurately \u2013 is at the core of the Bloomberg Terminal. Bloomberg\u2019s enterprise solutions build on the company\u2019s core strength: leveraging technology to allow customers to access, integrate, distribute and manage data and information across organizations more efficiently and effectively. For more information, visit Bloomberg.com/company or request a  demo . \u00a0 About BSE \u00a0 BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, commodity derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1,  2018, BSE launched commodity derivatives trading in Gold, Silver, Copper &  Oman Crude Oil. \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.\u00a0  \u00a0 Media Contact Yatin Padia/ Rahul Vyas 022 2272 8516 / 22728472 Yatin.padia@bseindia.com/   Rahul.vyas@indiainx.com \u00a0 \u00a0 \u00a0 \u00a0", "size": 53015, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.24805736541748047, "depth": 0, "status": 200, "links_url": "http:/