{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=282f2916-eb31-47cb-93d7-856515d83da2", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "h2": "Media Release", "body_text": "Media Release Media Release BSE gets approval from SEBI and RBI to launch Futures on Overnight Call Rate MIBOR\u00a0 \r\n \r\n Mumbai, March 27, 2019:  BSE, Asia\u2019s oldest exchange and now the world\u2019s fastest exchange with the speed of 6 microseconds, achieves another milestone by receiving approval from SEBI and RBI to introduce Interest Rates Futures on Overnight MIBOR (Mumbai Inter-Bank Offer Rate) consecutively to provide participants an opportunity to manage risk exposures. \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 MIBOR is the interest rate at which banks borrow from another for short term purposes. Financial Benchmarks India Pvt. Ltd announces the overnight MIBOR on a daily basis and is computed by the Clearing Corporation of India (CCIL). \u00a0 Speaking on this occasion, Shri Ashishkumar Chauhan, BSE MD & CEO said, \u201cBSE has become a force to recon with in IRF and Currency futures recently with large market share. With the opportunity to introduce interest rates futures on overnight MIBOR, market participants will be able to forecast and manage interest rate risk on BSE.\u00a0 \u00a0 BSE has always offered cutting edge, cost-efficient, convenient and disciplined risk management framework to market participants. Mibor Futures at BSE will provide a new useful instrument to market participants going forward. We are thankful to SEBI and RBI for the approval to launch the new innovative product\u201d\u00a0 \u00a0 The MIBOR rate is based on trade-weighted interbank call money transactions on the NDS (Negotiated Dealing System) call platform of CCIL between 9 a.m. and 10 a.m (except on public holidays). Thus, the reference rate is based on the actual traded rates as opposed to polled rates thus acting as an important tool that helps institutions manage interest rate risk. \u00a0 About BSE \u00a0 BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.\u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg).\u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.\u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani \r\n022 2272 8516 / 2272 8472 / 7738012080 \r\nYatin.padia@bseindia.com / Rahul.vyas@indiainx.com / mihir.dani@adfactorspr.com \u00a0 \u00a0", "size": 33064, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.487429141998291, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "22438", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in h