{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=13769e32-7ff5-4995-9d12-6c24f59b4073", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release  \u00a0 BSE extends XBRL mode for listed companies to file their Annual Reports on the Exchange \u00a0 Mumbai, Monday, 18 February 2019:   \u00a0 Continuing its endeavor to offer more ease in doing businesses and to enable filing of compliances in digital format, BSE has adopted the XBRL taxonomy published by the Ministry of Corporate Affairs, Government of India, for filing of Annual Returns by companies which includes the Annual Report.  \u00a0 This requirement will be in addition to the currently available PDF mode, which the companies are required to file with the Exchange along with notice of AGM, for financial year ending March 31, 2019.  \u00a0 The companies, can, if they desire also file their Annual Report submitted to the MCA as part of their Annual Returns for year ended March 31, 2018, in the XBRL mode to get a feel of the ease provided by the BSE Listing Centre.  \u00a0 \u00a0 BSE is well known for adopting state-of-the-art technologies to provide its users and customers a more enriching and satisfying experience.  This initiative of BSE will result in digital filing by companies and adoption of MCA taxonomy will lead to more ease of doing businesses, as companies need to simply use the same XBRL file for filing at the Exchange.  \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/mihir.dani@adfactorspr.com/ shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u00a0 \u00a0", "size": 32556, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.19443273544311523, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "cra