{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=cd4c8e0f-9546-4fad-8f5d-31d134b16c8b", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release BSE expands its agri-commodities portfolio; launches cotton futures contract on the exchange Mumbai, February 18, 2019:  BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds, has begun trading in cotton contracts today, after getting Sebi's nod to launch the natural fibre on the commodity derivatives exchange.  As part of the launch, BSE organized a bell ringing ceremony at the BSE International Convention Hall, which saw several distinguished dignitaries - Atul Ganatra, President, Cotton Association of India, Arun Sakhseria, Director, Cotton Association of India, Dr P. Alli Rani, Chairman & Managing Director, Cotton Association of India and Pasha Patel, Chairman, Agriculture Price Commission Agriculture Price Commission - grace the event.  \r\n \r\n The unit of trading for the cotton contract is 25 bales and the deliveries will be tendered in 100 bales. The quotation for cotton futures is in Rs. per bale (of 170 kg). The basic delivery centre for the cotton contracts is Rajkot with additional delivery centres at Aurangabad, Jalgaon Yavatmal in Maharastra and Mundra and Kadi in Gujarat. Commenting on the launch,  Mr. Ashishkumar Chauhan, MD & CEO, BSE  said, \u201cWith the launch of cotton contracts, we look forward to gain wider participation from cotton business stakeholders. While we began trading in commodities with gold and silver, our focus was to diversify and focus on agri products eventually. Last week, we launched Guarseed and Guargum that has witnessed record turnover and grabbed 36 % market share. We look forward for cotton futures contract to witness a marked rise in terms of volumes and emerge as the most compliant exchange in commodities.\u201d The contract start day will be the 1st day of contract launch month and the final trading day will be the last day of contract month. The commodity trading session will be from Monday to Friday from 9.00am to 9.00pm. It is a compulsory delivery contract, with the initial margins for the cotton contracts set at minimum 4 per cent or will be based on SPAN, whichever is higher. About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. Media Contact: Yatin Padia / Rahul Vyas /  Mihir Dani  /Shruti Nitesh 022 2272 8516 / 2272 8472 /   7738012080  /  8108000974 yatin.padia@bseindia.com / rahul.vyas@indiainx.com /  mihir.dani@adfactorspr.com /  shruti.nitesh@adfactorspr.com \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0 \u00a0", "size": 35904, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.17483234405517578, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "35904", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.