{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=77829fbc-7f41-41a8-ad14-71b2781e0f88", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release \u00a0 BSE resolved 101 investor\u2019s complaints against companies during the month of February 2019 \u00a0 Mumbai: March 01, 2019 : During the month, BSE received 103 complaints against 91   companies. In the same period 101 complaints were resolved against 90 listed companies. These resolved complaints include complaints brought forward from the previous periods. \u00a0 \r\n Type of complaints Complaints received Complaints resolved \u00a0 Against Active Companies Against Suspended Companies Total Against Active Companies Against Suspended Companies Total I 1 0 1 0 0 0 II 15 1 16 10 0 10 III 0 0 0 0 0 0 IV 58 1 59 72 0 72 V 0 0 0 0 0 0 VI 27 0 27 19 0 19 Total 101 2 103 101 0 101 \u00a0 The complaints received by BSE from Investors have been categorized as under: \r\n Type I Non-receipt of money (Refund, Interest, Redemption, Fractional Entitlement.) Type II Non-receipt of Equity shares ( Demat & Physical : In Public/Rights issue, Remat, Transfer, Transmission, Conversion / Endorsement / Consolidation/ Splitting / Duplicate Certificate) Type III Non-receipt of Debt Securities ( Demat & Physical : In Public/Rights issue, Remat, Transfer, Transmission, Conversion / Endorsement / Consolidation/ Splitting / Duplicate Certificate) Type IV Non-receipt of Corporate benefits / entitlements ( Dividend, Bonus, Rights form, \u00a0Buyback letter of offer, Delisting letter of offer, Annual Report ) Type V Non-receipt of Interest for delay in : ( Refunds, Dividend, Interest on debt security, Redemption of debt security , Securities ) Type VI Others ( Including Non-Adherence to Corporate Governance Norms ) Companies with highest number of complaints pending as on February 28, 2019. \u00a0 \r\n Sr. No. Company Name Category Number of complaints pending as on 28/02/2019 1 Geodesic Ltd XT 27 2 J.K. Pharmachem Ltd X 16 3 Teem Laboratories Ltd X 12 4 Gujarat Perstorp Electronics Ltd P 12 5 Gujarat Narmada Flyash Co. Ltd XT 11 6 Blazon Marbles Ltd X 11 7 Global Securities Ltd XT 10 8 Softrak Venture Investments Ltd X 9 9 Maharashtra Krishna Valley Develop - 8 10 Rane Computers Consultancy Ltd P 8 \u00a0 \u00a0 Trading in the securities of the aforesaid companies has been suspended . \u00a0 Media Contact Yatin Padia / Rahul Vyas 022 2272 8516 / 2272 8472 yatin.padia@bseindia.com  /  Rahul.vyas@indiainx.com \u00a0 \u00a0 \u00a0 \u00a0 \u00a0", "size": 201811, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.2734217643737793, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "201811", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  htt