{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=88b577dd-dbb4-4167-83f0-1f88eee1dec0", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release BSE launches XBRL taxonomy for listed insurance companies to file their financial results on the exchange Mumbai, Friday, 8 February 2019 : BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds has launched the XBRL taxonomy for enabling listed insurance companies to file their financial results with the exchange. It will now be mandatory for all listed insurance companies to file their financial results in XBRL format for period ending March 31, 2019, onwards. \u00a0 \r\n \r\n The filing of results in XBRL was already mandatory for all other types of listed entities, which has now been extended to listed insurance companies too.  \r\n \u00a0 BSE has also made available the simple Excel Utility with built-in validations to assist companies to simply fill in the details and prepare the XBRL file for uploading into BSE\u2019s Listing Portal. The exchange has also made the XBRL taxonomy available to all listed companies free of cost, on its website for enabling companies to directly generate XBRL files. \u00a0 All companies would be required to file the financial results in PDF format along with the LRR/Auditors Report, through CAFS system within 30 minutes of conclusion of Board Meeting and follow this up with the XBRL filing within 24 hours. Announcements through BSE\u2019s CAFS system will reflect seamlessly and almost instantaneously on the exchange\u2019s website for public dissemination. \u00a0 BSE is well known for adopting state-of-the-art technologies and using them to provide its users and customers a more enriching and satisfying experience. This  investor-friendly move is expected to enable faster and better decision making by investors and public at large.  \u00a0 \r\n \r\n About BSE \r\n BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. \u00a0 \r\n \r\n BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \r\n \u00a0 \r\n \r\n BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \r\n \u00a0 \r\n \r\n Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.  \r\n \u00a0 \r\n \r\n Media Contact: \r\n Yatin Padia / Rahul Vyas  022 2272 8516 / 2272 8472  Yatin.padia@bseindia.com / Rahul.vyas@indiainx.com   \u00a0 \u00a0", "size": 46391, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.16202473640441895, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "46391", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in https://adservice.google.com  https://securepubads.g.doubleclick.net https://j.marketsmojo.com https://www.googletagservices.com  https://www.googletagmanager.com https://chatbot.