{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=17af95e2-17d4-48fa-accb-18831c7cf37e", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release  BSE\u2019s market share in guar seed trading soars to 36% on Day 4 of trading; records highest turnover of INR 73 cr on February 12, 2019 \u00a0 March futures contract gains open interest of 2450 MT \u00a0 Mumbai, 13 February 2019:  BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds, hit a record high of INR 73 crore in Guar seed futures contract with a market share of 36 per cent as on February 12, 2019. \u00a0  The total turnover of Guar seed March futures contract in the three trading sessions since launch is INR 192 crore with Open Interest of 2450 MT.  \u00a0 Market regulator Sebi, last month, allowed the exchange to launch futures trading in Guar seed and Guar gum futures contracts. Following this, the exchange launched trading in the two-agriculture commodities Guar seed and Guar gum on February 7, 2019. \u00a0 Commenting on the record turnover , Shri Ashishkumar Chauhan, MD & CEO, BSE  said, \u201cWe are happy and thankful to have received a very welcoming and warm response from agri commodities community in the first week, as Guar contracts are our first set of contracts launched in agri commodities. We hope to launch many more contracts in the near future, including Cotton contracts next week for which we have already received Sebi approval. We hope to build on this success in the entire gamut of commodities, agri and non agri commodities in 2019.\u201d \u00a0 Trading in Guar seed futures contract is witnessing higher turnover and market share in its first week of launch itself. BSE is taking special initiatives to promote trading interest in agriculture commodities. The advanced technology and lowest transaction cost are enabling the volumes to surge, which in turn will facilitate BSE to emerge as market leader in the commodities segment. \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.  \u00a0 Media Contact: Yatin Padia / Rahul Vyas / Mihir Dani/ Shruti Nitesh 022 2272 8516 / 2272 8472 / 7738012080/ 8108000974 Yatin.padia@bseindia.com/Rahul.vyas@indiainx.com/mihir.dani@adfactorspr.com/\u00a0shruti.nitesh@adfactorspr.com \u00a0", "size": 33294, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.2464451789855957, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "22403", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in https://adservice.google.com  https://securepubads.g.doub