{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=e6705361-5470-4ed9-aac1-a2ad63f9c9a4", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Ritco Logistics Limited  Two Hundred and Eighty Third Company to get listed on BSE SME Platform Mumbai, February 7, 2019: SEBI  came out with detailed guidelines on 18 th  May, 2010 for launching of SME Exchange/Platform . BSE  became the first stock exchange to get the approval from SEBI and launch its SME platform on 13 th  March, 2012.  \u00a0 Ritco Logistics Limited   became   283 rd   company   respectively to get listed on the BSE SME Platform on February 07,2019.  Ritco Logistics Limited  came out with an initial public offering of  66,00,000   Equity Shares of Rs.10/- Each (\u201cEquity Shares\u201d) For Cash At a Price Of  Rs . 73 /- Per Equity Share (The \u201cOffer Price\u201d), Aggregating to Rs. \u20194,818.00 \u2019  lacs.   The company has successfully completed its public issue on January 30, 2019.  \u00a0 Ritco Logistics Limited  is a Haryana based company whose registered office is at New Delhi.  The  Company is  engaged in supply chain solution, providing land base logistics, warehouse and other value-added services in India. The company offers a broad, integrated freight transpiration service under bulk load, dedicated load (to-and-fro), full truck load (FTL) and less than truck load (LTL) utilizing company owned fleets or through independent third party-operator; and other ancillary services such as warehouse and value-added services. We offer technology-enabled logistic and other distribution solution designed primarily for the corporate customer. \u00a0 Mumbai based  Pantomath Capital Advisors Private Limited  was  the lead manager for  Ritco Logistics Limited. \u00a0 The 283 companies listed on BSE SME Platform have raised Rs.2903.72 crores from the market and total market capitalization of 283 companies as on February 07, 2019 is 18,385.11 Crores. BSE is the market leader in this segment with a market share of 59.58 percent. \u00a0 The response since the launch of this platform by BSE has been very positive and till date, the following 282 companies have already listed on this platform. \u00a0 About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \u00a0 Media Contact: Yatin Padia / Rahul Vyas  022 2272 8516 / 2272 8472  yatin.padia@bseindia.com/rahul.vyas@indiainx.com   \u00a0 \u00a0", "size": 44353, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.19999051094055176, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "44353", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google