{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=fe79f5da-43d3-4054-8e9d-4f4121bd3b4f", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release BSE commences commodity derivatives trading in Guarseed and Guargum Mumbai, February 6, 2019 : BSE, Asia\u2019s oldest exchange and now world\u2019s fastest exchange with the speed of 6 microseconds, today commenced commodity derivatives trading in Guarseed and Guargum with a lot size of 10 metric tons. Recently, BSE had tied up with various agricultural premier associations and warehouse service providers in India for the growth and development of commodity derivatives markets in the agricultural complex. BSE had also entered into a licensing agreement with the London Metal Exchange and associated with Bombay Metal Exchange for base metal contracts, besides tying up with the Rajkot Commodity Exchange, Federation of Indian Spice Stakeholders, Soybean Processors Association of India and Cotton Association of India to launch agri commodities. Shri Ashishkumar Chauhan, MD & CEO, BSE  said, \u201cCommodities derivatives were launched as a segment on BSE on 1st October 2018 making it India\u2019s 1st universal exchange. Initially gold and silver contracts were launched for trading followed by India\u2019s 1st deliverable copper contract and oman crude oil contract. Our long-term vision is to introduce various agri/non-agri commodities as well. India\u2019s commodity market is in its nascent stage and we believe there is a lot of scope for growth, which can happen by diversifying into new commodities to provide effective risk hedging instruments using the latest technology and risk management framework to all Indian stakeholders. BSE has the largest reach in India with 4.1 crore investors registered on the bourse. We are constantly working on increasing the reach and attracting more market participants by offering cost-efficient, convenient and most disciplined framework.\u201d About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. Media Contact : Yatin Padia / Rahul Vyas  \r\n022 2272 8516 / 2272 8472 \r\n yatin.padia@bseindia.com/rahul.vyas@indiainx.com \r\n \u00a0 \u00a0 \u00a0", "size": 19786, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.20711851119995117, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_content-length": "13632", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\":443\"; ma=2592000,h3-29=\":443\"; ma=2592000,h3-Q050=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"", "resp_headers_cache-control": "private, max-age=60", "resp_headers_content-security-policy": "default-src https://*.mgid.com https://cdn.ampproject.org/ https://*.googlesyndication.com https://*.bseindia.com 'self'  ;  img-src https://*.bseindia.com https://*.mgid.com *.gstatic.com *.google.com https://www.google.co.in/  https://i.marketsmojo.com https://www.google-analytics.com https://*.doubleclick.net  https://tpc.googlesyndication.com https://googleads.g.doubleclick.net  https://www.google.com https://chatbot.bseindia.com 'self' https://googleads.g.doubleclick.net data: chrome-extension-resource storage.googleapis.com pagead2.googlesyndication.com;;   script-src blob: filesystem:  https://*.bseindia.com https://*.mgid.com  https://jsc.mgid.com/ *.gstatic.com *.google.com https://s.go-mpulse.net/ https://*.googlesyndication.com/ https://cdn.ampproject.org/ https://acdn.adnxs.com https://ajax.googleapis.com  https://www.google-analytics.com https://adservice.google.co.in https://adservice.google.com  https://securepubads.g.doubleclick.net https://j.marketsmojo.com https://www.googletagservices.com  https://www.googletagmanager.com https://chatbot.bseindia.com https://st