{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=65965bb8-7805-4120-9208-f467949da439", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release BSE announces launch of a mobile app for retail investors to gain direct access in auction of G-sec and T-bills from February 1st, 2019 \u00a0 Announces trading of T-bills in capital market segment w.e.f February 1st, 2019 \u00a0 Mumbai, January 31, 2019:  In its attempt to further the interests of retail investors, BSE, India\u2019s first universal exchange has announced the launch of a mobile app for investors to participate in the auction of Government securities (G-sec) and Treasury bills (T-bills) conducted by Reserve Bank of India. The app, effective from February 1, 2019, would enable investors to directly participate in auction of G-sec and T-bills without the involvement of a registered trading member of BSE. \u00a0 Earlier, on December 3rd 2018, BSE had launched \u2018BSE-Direct\u2019, an online bidding platform for retail investors to participate in non- competitive bidding of G-sec and T-bills. The online platform offers a user-friendly interface, allows 24 x 7 bidding and enables collection of bids from investors.\u00a0Investors who bid through BSE Direct will have a facility to electronically pay from their bank accounts directly to the exchange and will get the securities directly in their demat account post allotment.  \u00a0 The exchange will also enable trading of T-bills in the capital market segment, with effect from February 1, 2019. The trading of T-bills in secondary markets will provide an exit route for investors who have been holding securities in the demat format. \u00a0 BSE is a premier exchange for investing in G-sec and T-bills in non-competitive bidding. While G-secs are a risk\u00a0-free investment avenue that offer investors the comfort to stay invested for long term and generate regular, stable income, the T-bills provide for a safe, liquid instrument, for investors to put in their money on a short-term basis.  \u00a0 About BSE \u00a0 BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most 