{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=366a91c0-9e14-45c8-8e98-f9efdd403502", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release \r\n Media Release \r\n \u00a0 \r\n Consolidated Total Income up for the quarter ended December 31, 2018 by 8% to Rs 177.11 crore from Rs 164.05 crore for the quarter ended September 30, 2018. \r\n \u00a0 \r\n Consolidated Profit after tax from continuing operations for the quarter ended December 31, 2018 up by 23% to Rs 50.07 crore from Rs 40.74 crore for the quarter ended September 30, 2018. \r\n \u00a0 \r\n Consolidated Earnings per share from continuing operations for the quarter ended December 31, 2018 up by 23% to Rs 9.52 per share from Rs 7.75 per share for the quarter ended September 30, 2018. \r\n \u00a0 \r\n Strong business growth across segments - \r\n \u00fc \u00a0  Currency Derivative Segment - Average daily turnover increased by 82% to Rs 31,384 crore for nine months ended December 31, 2018 from Rs 17,270 crore for nine months ended December 31, 2017. \u00a0  \r\n \u00fc \u00a0  Mutual Fund Segment - Orders processed in Mutual Fund Segment increased by 137% to 253 lakh for nine months ended December 31, 2018 from 107 lakh for nine months ended December 31, 2017. \r\n \u00fc   India International Exchange (IFSC) Ltd. (\u201cIndia INX\u201d) - Average daily turnover in India INX, BSE\u2019s wholly owned subsidiary at GIFT City, Gandhinagar increased by 996% to USD 694 million for nine months ended December 31, 2018 from USD 63 million for nine months ended December 31, 2017. \r\n \u00fc   Commodity Derivatives Segment - Successfully launched Commodity Derivative segment from October 1, 2018 becoming the first universal exchange in India. Total turnover till December 31, 2018 is Rs 18,032 crore. \r\n \u00fc \u00a0  BSE Startups \u2013 BSE has launched \u2018BSE Startups\u2019, a new platform for entrepreneurs to list their startups on December 22, 2018.  \r\n \u00a0 \r\n MUMBAI, February 1, 2019:  BSE Ltd. (BSE), Asia\u2019s oldest and first universal exchange and World\u2019s fastest exchange with a speed of 6 microseconds, announced its unaudited consolidated financial results for the quarter ended December 31, 2018.  \r\n \u00a0 \r\n Financial Highlights at a Glance: \r\n \u00a0 \r\n \r\n \r\n     \r\n         \r\n             \r\n             Particulars \r\n             \r\n             \r\n             Q3 FY19  \r\n             (Rs crore) \r\n             \r\n             \r\n             Q2 FY19  \r\n             (Rs crore) \r\n             \r\n             \r\n             QoQ Growth \r\n             \r\n         \r\n         \r\n             \r\n             Total Income \r\n             \r\n             \r\n             177.11 \r\n             \r\n             \r\n             164.05 \r\n             \r\n             \r\n             \u2191 8% \r\n             \r\n         \r\n         \r\n             \r\n             Profit after Tax from continuing operations \r\n             \r\n             \r\n             50.07 \r\n             \r\n             \r\n             40.74 \r\n             \r\n             \r\n             \u00a0  \u219123 % \r\n             \r\n         \r\n         \r\n             \r\n             Profit after Tax from total operations \r\n             \r\n             \r\n             50.07 \r\n             \r\n             \r\n             45.85 \r\n             \r\n             \r\n             \u21919 % \r\n             \r\n         \r\n         \r\n             \r\n             Earnings per share (from continuing operations) \r\n             \r\n             \r\n             9.52 \r\n             \r\n             \r\n             7.75 \r\n             \r\n             \r\n             \u00a0  \u219123 % \r\n             \r\n         \r\n         \r\n             \r\n             Earnings per share (from total operations) \r\n             \r\n             \r\n             9.52 \r\n             \r\n             \r\n             8.72 \r\n             \r\n             \r\n             \u21919 % \r\n             \r\n         \r\n     \r\n \r\n \r\n \u00a0 \r\n Interim dividend of Rs 5 per equity share paid to all the equity shareholders who hold equity shares of BSE Limited as on record  \u00a0 date December 12, 2018. \r\n \u00a0 \r\n \u00a0 \r\n \u00a0 \r\n Business Highlights for the Period Ended December 31, 2018 \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Mutual Fund Segment  :  The number of registered mutual fund distributors increased to 20,082 as on January 31, 2019. The total number of SIPs registered under this segment increased by 35% to 3,97,153 for the nine months ended December 31, 2018 from 2,94,165 for the nine months ended December 31, 2017. The total number of XSIPs registered under this segment increased by 112% to 11,86,087 for the nine months ended December 31, 2018 from 5,59,387 for the nine months ended December 31, 2017. The total number of order processed in the Mutual Fund Segment increased by 137% to 253 lakh for the nine months ended December 31, 2018 from 107 lakh for the nine months ended December 31, 2017. The total value of orders processed in the Mutual Fund Segment increased by 44% to Rs 1,13,744 crore for the nine months ended December 31, 2018 from Rs 78,845 crore for the nine months ended December 31, 2017. Further, the total number of orders received in the month of December, 2018 is higher by 108% as compared to the orders received in the month of December, 2017. \r\n BSE StAR MF, India\u2019s largest Mutual Funds Distributor platform recorded a new high of 6.40 lakh transactions on December 10, 2018. BSE StAR MF surpassed the earlier highest of 5.94 lakh transactions in a single day on September 10, 2018. The BSE StAR MF telegram group user has crossed 6900 members, as of January 28, 2019.\u00a0 The group has redefined the service standards of Mutual Funds Distributors in India. The robustness and seamlessness of BSE StAR MF, the swiftness of distributors, and query resolution through real-time interaction through BSE StAR MF user\u2019s telegram group have created an ideal ecosystem for all stakeholders in India\u2019s Mutual Funds Industry. BSE StAR MF creating an overall distribution network of over 2,00,000 in over 3000 cities and towns of India. BSE has once again exhibited that with scalability, the service standards notch higher. As on date more than 2.65 crore unique investors are registered on the platform. In the current fiscal, till 12th\u00a0Nov 2018, BSE StAR MF has processed nearly 202.49 Lakhs transactions amounting to Rs 75,000 crore, processing over 32 lakh transactions per month, equivalent to 19% of the annual transactions of FY 2017-18.  \u00a0 BSE\u2019s market share in this segment for the nine months ended December 31, 2018 stands at 79%. \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Currency Derivative Segment  : \u00a0  BSE\u2019s average daily turnover in currency derivatives segment has increased by 82% to Rs 31,384 crore for the nine months ended December 31, 2018 from Rs 17,270 crore for the nine months ended December 31, 2017. \u00a0  The total contracts too has grown by 67% to 82.06 crore contracts as on \u00a0  December 31, 2018 to 49.01 crore contracts as on December 31, 2017. \u00a0  The growth has been aided by increase in turnover in both currency futures contracts as well as currency options contracts. \u00a0  The average daily turnover in currency futures segment has increased by 89% to Rs 13,820 crore for the nine months ended December 31, 2018 from Rs 7,297 crore for the nine months ended December 31, 2017. \u00a0  The average daily turnover in currency options segment has increased by 76% to Rs 17,564 crore for the nine months ended December 31, 2018 from Rs 9,973 crore for the nine months ended December 31, 2017. \u00a0  BSE\u2019s market share in this segment for the nine months ended December 31, 2018 stands at 47%. \r\n \u00a0 \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Commodity Derivatives Segment : \u00a0  BSE became the first universal exchange in India on October 1, 2018 with successful launch of  Commodity Derivative segment with the launch of Gold and Silver futures. \u00a0  BSE launched contracts in Oman Crude Oil futures on October 26, 2018 and Copper contracts on November 2, 2018. Over the past one year, BSE has tied up with various associations in the commodities business for growth of and development of commodities derivatives business in India. \u00a0  The entities with whom BSE has tied up includes renowned entities including London Metal Exchange, Dubai Mercantile Exchange, Bombay Metal Exchange,  Cotton Association of India , Federation of Indian Spices Stakeholders, Gems Jewellery Council, Bullion Federation etc. \u00a0  Till December 2018, the turnover in this segment has been steadily improving and recorded a turnover of Rs 18,032 crore as on December 31, 2018. Highest turnover recorded on October 25, 2018 with value of Rs 621 crore. Of the same, share of Gold derivatives is 89% and Silver derivatives is 11%. BSE\u2019s share in this segment (vis-\u00e0-vis other domestic exchanges commencing business in commodity derivatives segment in October 2018) as on December 31, 2018 stands at 90%.  \u00a0 BSE has registered 200 trading members and 27 clearing members in the commodity derivatives segment as on January 22, 2019. \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  India International Exchange (IFSC) Ltd. (\u201cIndia INX\u201d)  :  Average daily turnover in India INX, BSE\u2019s wholly owned subsidiary at GIFT City, Gandhinagar witnessed  a phenomenal growth of 996%  to USD 694 million for the nine months ended December 31, 2018 from USD 63 million for the nine months ended December 31, 2017. \u00a0  The turnover comprises of significant contribution by Equity Derivatives Segment as well as Commodity Derivatives Segment. \u00a0  The Equity Derivatives Segment contributed to 67% of average daily turnover and the Commodities Derivatives Segment contributed to 33% of average daily turnover for the nine months ended December 31, 2018. \u00a0  BSE\u2019s market share in this segment for the nine months period ended on December 31, 2018 is 70%. \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  India INX Global Access (IFSC) Ltd. :  India INX has launched India INX Global Access IFSC Limited (\u201cGlobal Access\u201d), it aims to become the leading financial services provider in IFSC GIFT City in the years ahead by facilitating a centralized access to international financial markets for its customers. For participants at GIFT IFSC, Global Access will provide a unified single-window interface for trading on CME Group of exchanges with immediate effect. For members and clients of India INX, Global Access offers a competitive and sustainable value proposition to access global markets in a cost efficient way. \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Power Exchange :  BSE along PTC India Limited and ICICI Bank Limited have filed a petition with the power market regulator, CERC (Central Electricity Regulatory Commission) on September 7, 2018 for grant of license for setting up a new power exchange. The same has been admitted by Central Electricity Regulatory Commission (CERC). This proposed institutional exchange, subject to necessary regulatory approvals, would leverage on the experience and expertise of its stakeholders in their fields; knowledge of the power sector, funding of power projects and associated infrastructure, setting-up and running various exchanges and platforms in India, and offer the market participants a credible power trading platform. \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  Insurance Broking :  BSE has set up a Joint venture with   Ebix named BSE Ebix Insurance Broking Private Limited for conducting Insurance Broking business where BSE holds equity stake of 40%. The regulatory approval from  \u00a0 Insurance Regulatory and Development Authority of India (IRDA) for the same is awaited. \r\n \u00a0 \r\n \u00b7 \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0  BSE Startups  : BSE has launched \u2018BSE Startups\u2019 on December 22, 2018. As part of the launch, the leading bourse also signed MOU with Cornerstone Ventures Investment Advisers LLP and Venture Catalysts Private Limited. The strategic collaboration with the two firms will enable BSE to further incentivise the startup firms in sectors like IT, ITeS, biotechnology and life sciences, 3D printing, space technology and e-commerce. The platform will also help in listing of firms from hi-tech defence, drones, nano technologies, artificial intelligence, big data, virtual reality, e-gaming, robotics, genetic engineering, amongst other sectors. \r\n \u00a0 \r\n \u00a0 \r\n \u00a0 \r\n Commenting on financial performance for the quarter and nine months, Shri Ashishkumar Chauhan, MD & CEO, said:   \u201cBSE continues to be the platform of choice for investment in equity, mutual funds and debt securities. \u00a0  The stellar growth in investments being made through StAR Mutual Fund platform reinforces our leadership position in the fintech segment and stands as a testimony to the same. \u00a0  BSE would continue to  \u00a0 identify new opportunities in the Exchange and Fintech businesses to promote financial inclusion among the masses in India and help create wealth for all its stakeholders.\u201d  \r\n \u00a0 \r\n About BSE \r\n BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & the world\u2019s fastest Stock Exchange with a speed of 6 microseconds. BSE is India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing. \r\n \u00a0 \r\n BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments. \r\n \u00a0 \r\n Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India. \r\n \u00a0 \r\n Media Contact \r\n Yatin Padia \r\n 022 2272 8516 \r\n yatin.padia@bseindia.com \r\n \u00a0 \r\n \u00a0", "size": 137232, "download_timeout": 180.0, "download_slot": "www.bseindia.com", "download_latency": 0.19132637977600098, "depth": 0, "status": 200, "ip_address": "152.195.35.82", "crawl_time": "2022-11-04 06:00:32", "resp_headers_access-control-allow-methods": "GET,PUT,POST,DELETE,OPTIONS", "resp_headers_access-control-allow-origin": "*", "resp_headers_alt-svc": "h3=\"