{"url": "https://www.bseindia.com/markets/marketinfo/DispMediaRels.aspx?page=3d571408-99e2-465a-b3a8-5c5e60fbce52", "title": "\r\n\tBSE (formerly Bombay Stock Exchange) \r\n", "viewport": "width=device-width; initial-scale=1.0; maximum-scale=1.0; user-scalable=0;", "body_text": "Media Release Media Release \u00a0 BSE partners with John Chambers\u2019 backed Lucideus to secure stock brokers as per SEBI guidelines using SAFE \u00a0 Lucideus to use SAFE platform and score to provide \u2018SOC as a Service\u2019  \u00a0 Mumbai, January 15, 2019:  India\u2019s premier stock exchange, BSE, has signed a Memorandum of Understanding (MoU) with Lucideus, the leading cyber security provider in India to ward off potential cyber threats and secure stock brokers\u2019 interests as per the SEBI guidelines.  \u00a0 Lucideus will build and provide a Cyber Security Operations Center (SOC) as a service using Lucideus\u2019 Artificial Intelligence and Machine Learning-backed Security Assessment Framework for Enterprises (SAFE) solution as per the Cyber Security & Cyber Resilience framework for Stock Brokers / Depository participants released by the market regulator on 3rd December 2018.  \u00a0 SAFE will be able to provide the entire broker community a single-click subscription option, where they can opt into the solution that will be offered via Marketplace Tech Infra Services (a wholly-owned subsidiary of BSE). It will provide an on-premise SAFE-in-a-box solution synced with Lucideus SAFE solution hosted at the BSE Data Centres to provide real-time monitoring of all parameters covered in the guideline. The on-premise box solution will host open-source tools along with the SAFE software that will aggregate insights from each terminal and sense the network security controls to send them along with the sys-logs to SAFE to be processed in real-time. \u00a0 Commenting on the development,  S. Ravi, Chairman, BSE , said, \u201cWith an evolving array of potential cyber-attacks, it has become essential to have robust cyber security in place and safeguard the interests of our stock brokers. Even a minor cyber security breach could have massive economic and financial consequences. By associating with Lucideus, the leader in cyber security services and solutions, we aim to strengthen the cyber security framework, tackle all the challenges pertaining to capital markets ecosystem and adhere to SEBI\u2019s guidelines to protect the integrity of data and guard against breaches of privacy.\u201d Commenting on the partnership,  John Chambers, former Chairman & CEO of Cisco, and current Founder & CEO of JC2 Ventures,  said \u201cAs the fastest stock exchange in the world, BSE is a global benchmark for companies today. BSE has always been in the forefront of enabling cutting-edge technology solutions, and Lucideus has been a game-changer in the cybersecurity industry since its inception. This will be a true win-win partnership for not only BSE and Lucideus but also for the entire broker community and their customers. Together, BSE and Lucideus will ensure the safety and security of data, in line with the global best practices that the SEBI framework covers.\u201d Saket Modi, CEO & Co-Founder of Lucideus , said \u201cLucideus is committed to working with BSE and market participants to monitor developments and protect them against the threats through cyber intrusion, denial of service attacks, manipulation, misuse by insiders and other cyber misconduct. In such uncertain times with global Fortune 500 companies being hacked regularly, we are confident of delivering a platform (via SAFE) that the entire broker ecosystem and the regulator can rely upon.\u201d The SAFE platform integrates with the existing technology stack of an enterprise to provide a real-time cyber risk assessment (a number between 0-5) at a macro level across the organization that can be broken down into micro-level scoring individually for each asset. It considers controls across people, process and technology. With this, Lucideus aims to make cyber risk an informed business decision such that it will allow the security team to communicate to the non-tech specialists (CXOs, Business Unit Leaders and Board) about the cyber security posture of the enterprise. About BSE BSE (formerly Bombay Stock Exchange) established in 1875, is Asia\u2019s first & now the world\u2019s\u00a0fastest Stock Exchange with a speed of 6 microseconds. BSE is\u00a0India\u2019s leading exchange group and has played a prominent role in developing the Indian capital market. BSE is a corporatized and demutualised entity, with a broad shareholder base that includes the leading global exchange- Deutsche Bourse, as a strategic partner. BSE provides an efficient and transparent market for trading in equity, debt instruments, equity derivatives, currency derivatives, interest rate derivatives, mutual funds and stock lending and borrowing.  \u00a0 BSE also has a dedicated platform for trading in equities of small and medium enterprises (SMEs) that has been highly successful. BSE also has a dedicated MF distribution platform BSE StAR MF which is India Largest Mutual Funds Distribution Infrastructure. On October 1, 2018, BSE launched commodity derivatives trading in delivery-based futures contract in gold (1 kg) and silver (30 kg). \u00a0 BSE provides a host of other services to capital market participants including risk management, clearing, settlement, market data services and education. It has a global reach with customers around the world and a nation-wide presence. BSE\u2019s systems and processes are designed to safeguard market integrity, drive the growth of the Indian capital market and stimulate innovation and competition across all market segments.  \u00a0 Indian Clearing Corporation Limited, a wholly owned subsidiary of BSE, acts as the central counterparty to all trades executed on the BSE trading platform and provides full novation, guaranteeing the settlement of all bonafide trades executed. BSE Institute Ltd, another fully owned subsidiary of BSE runs one of the most respected capital market educational institutes in the country. Central Depository Services Ltd. (CDSL), associate company of BSE, is one of the two Depositories in India.\u00a0  About Lucideus Incubated out of IIT Bombay and backed by John Chambers, former Chairman & CEO of Cisco, and current Founder & CEO of JC2 Ventures Lucideus is a pure play enterprise cyber security company. It provides Cyber risk assessment services and platforms to multiple Fortune 500 companies and governments across the globe. With over 200 customers, today it today secures over 11% of India\u2019s urban GDP. For the last 3 years, it has been responsible for the end-to-end cyber security assessment of the BHIM Payments Application launched by the Prime Minister of India and has the highest market share of over 60% for the complete security assessments of UPI Payments enabled applications such as Whatsapp, Google Tez, BookMyShow, MiPay, Truecaller among others.  The company is known for its Artificial Intelligence and Machine Learning backed Enterprise-Wide \u00a0  Cyber Risk Measurement and Mitigation platform called SAFE (Security Assessment Framework for an Enterprise) that incorporates internal and external parameters across people, process and technology to gives a simple SAFE Score (between 0 and 5) along with actionable insights to companies that is used by internal security and technology teams, leadership and boards to monitor their organization-wide cyber security posture in a real-time basis. For more information visit  https://www.lucideus.com/  or follow  @lucideustech . You can see a 4-minute video about Lucideus  here . \u00a0 Media Contact: BSE \u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u00a0\u0